INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(1, 'Abant İzzet Baysal Üniversitesi', 'Abant İzzet Baysal Üniversitesi, Gölköy Yerleşkesi, Merkez, Bolu, 14280, Türkiye', 'http://www.ibu.edu.tr/templates/ibu/images/aibu_logo.png', 'http://www.ibu.edu.tr/', '3 Temmuz 1992’de kurulan Abant İzzet Baysal Üniversitesi Bolu’da yer almaktadır. 10 fakülte, 4 enstitü, 6 yüksekokul, 7 meslek yüksekokulu ve 13 araştırma merkezinde yaklaşık 25.000 öğrenci eğitim görmektedir. Tüm bu birimlerinde görev yapan 900 öğretim elemanı ve 550 idari personel bulunmaktadır. Merkezi yerleşkesi Bolu merkez olmak üzere toplam 4 yerleşkesi ( Gerede, Mengen, Mudurnu) bulunmaktadır.', 'abant-izzet-baysal-universitesi', '31.5135089', '40.7138639', 'Bolu', NULL, '/m/0bsybb');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(2, 'Abdullah Gül Üniversitesi', 'Abdullah Gül Üniversitesi, Sümer Kampüsü, Kayseri, Türkiye', 'http://www.agu.edu.tr/site/tpl/microsites/agu/images/logo.png', 'http://www.agu.edu.tr', 'Abdullah Gül Üniversitesi, 2010 yılında Kayseri\'de üçüncü nesil üniversitelerin öncüsü olma vizyonu ile ilk vakıf destekli devlet üniversitesi modeli ile kurulmuş bir devlet üniversitesidir. Abdullah Gül Üniversitesi’nin Mimar Sinan Kampüsü ve Sümer Kampüsü olmak üzere iki yerleşkesi bulunmaktadır. Abdullah Gül Üniversitesi, öğrenen odaklı yaklaşımıyla geleceği şekillendirecek bireyler ve küresel sorunlara çözüm arayan bir araştırma üniversitesi olarak kurduğu ortaklıklarla bilgiyi değere dönüştürme misyonuyla eğitim öğretim faaliyetlerine devam etmektedir.', 'abdullah-gul-universitesi', '35.472624', '38.739704', 'Kayseri', NULL, '/m/0r8pg9z');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(3, 'Adana Bilim Ve Teknoloji Üniversitesi', 'Adana Bilim ve Teknoloji Üniversitesi, Yeşiloba Yerleşkesi Yeşiloba Mah.Öğretmenler Bulvarı 46278 Sokak No:3 01180 Seyhan / ADANA', 'http://www.adanabtu.edu.tr/tr/images/logo_vektorel_adanabtu-01.png', 'http://www.adanabtu.edu.tr', 'Adana Bilim ve Teknoloji Üniversitesi (ABTÜ), 2011 yılında kurulmuş genç ve dinamik bir devlet üniversitesidir. Bünyesinde 9 Fakülte, 2 Enstitü ve 1 Yüksekokul bulunan ABTÜ ilk öğrencilerini 2013 yılında almıştır. Yüksek donanıma sahip, son teknoloji cihazlarla donatılmış laboratuvar alt yapısına sahip olan ABTÜ, basılı materyallerin yanı sıra 66.563 e-dergi, 215.000 e-kitap, 23.000 e-sesli kitap ve 3 milyon pdf kitap bulunan uluslararası standartlarda elektronik kütüphaneye sahiptir. ABTÜ; öğrenci değişim programlarına sahip, öğrenci projelerini destekleyen; özetle öğrenci ile yakından ilgilenen bir anlayış ile eğitim veren bir üniversitedir.', 'adana-bilim-ve-teknoloji-universitesi', NULL, NULL, 'Adana', NULL, '/m/0114nwy_');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(4, 'Adnan Menderes Üniversitesi', 'Adnan Menderes Üniversitesi Merkez Kampüsü, Kepez Mevkii Efeler / AYDIN', 'http://www.adu.edu.tr/webfolders/logolar/Adnan-Menderes-Universitesi.jpg', 'http://www.adu.edu.tr', 'Adnan Menderes Üniversitesi, 1992 yılında Aydın\'da kurulmuş olan bir devlet üniversitesidir. 14 fakülte, 3 enstitü, 5 yüksekokul, 18 meslek yüksekokulu, 1 Devlet Konservatuvarı, 24 Uygulama ve Araştırma Merkezi ile eğitim veren üniversitede 1647 Akademik, 1165 İdari personel görev yapmaktadır. Gençliğin bilgiyle buluştuğu üniversite sloganı ile eğitim hayatını sürdüren üniversitede 50,000 kadar öğrenci öğrenim görmektedir', 'adnan-menderes-universitesi', NULL, NULL, 'Aydın', NULL, '/m/03c9hny');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(5, 'Adıyaman Üniversitesi', 'Altınşehir Mah. 3005. Sokak, 02040 Adıyaman Merkez/Adıyaman, Türkiye', 'http://www.besyoyeteneksinavlari.com/wp-content/uploads/ad%C4%B1yaman-%C3%BCniversitesi-logo.jpg', 'http://www.adiyaman.edu.tr/', 'Adıyaman Üniversitesi 2006 yılında bilgi, ürün ve hizmet üreterek sağlık, tarım ve hizmet sektöründe bulunduğu bölgenin sosyo-ekonomik yapısını geliştiren ve tercih edilen bir üniversite olma vizyonuyla Adıyaman’da kurulmuş bir devlet üniversitesidir. Üniversitenin Adıyaman merkez ilçede ana yerleşkesi, Besni, Gölbaşı ve Kahta ilçelerinde de birer yerleşkesi bulunmaktadır. Üniversite bünyesinde bulunan 13 fakülte, 3 enstitü, 3 yüksekokul, 6 meslek yüksekokulu, 4 araştırma ve uygulama merkezinde 834 akademisyen faaliyet göstermekte, 17873 öğrenci ise bu birimlerde öğrenim görmektedir.', 'adyaman-universitesi', '38.2304333', '37.7449056', 'Adıyaman', NULL, '/m/0cpnh40');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(6, 'Afyon Kocatepe Üniversitesi', 'Afyon Kocatepe Üniversitesi Rektörlüğü, Ahmet Necdet Sezer Kampusü, Gazlıgöl Yolu, 03200 AFYONKARAHİSAR ', 'http://aku.edu.tr/wp-content/uploads/2016/02/logo.jpg', 'http://www.aku.edu.tr/', '', 'afyon-kocatepe-universitesi', NULL, NULL, 'Afyonkarahisar', NULL, '/m/0g9w17k');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(7, 'Ağrı İbrahim Çeçen Üniversitesi', 'Fırat Mh. Erzurum Yolu Üzeri 4. km, 04100 Ağrı, Türkiye', 'http://i.onbesyirmibes.org/image/2013/02/25/338105.jpg', 'http://www.agri.edu.tr', 'Ağrı İbrahim Çeçen Üniversitesi 2007 yılında kurulmuştuştur. Ağrı\'da Erzurum Yolu Üzeri\'nde bulunan yerleşkesinde faaliyet gösteren üniversitenin bünyesinde 6 fakülte, 3 enstitü, 6 yüksekokul ve meslek yüksekokulu ve 5 araştırma ve uygulama merkezi bulunmaktadır. 13.615 öğrencinin öğrenim gördüğü üniversitede 403 akademik personel görev almaktadır.', 'agr-ibrahim-cecen-universitesi', '42.9917789', '39.7197119', 'Ağrı', NULL, '/m/0g9y3y9');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(8, 'Ahi Evran Üniversitesi', 'Bağbaşı, Sahir Kurutluoğlu Cad. No:100, 40100 Merkez/Kırşehir, Türkiye', 'http://www.gribilge.com/wp-content/uploads/2014/06/ahi-evran-%C3%BCni-logo.png', 'http://www.ahievran.edu.tr/', 'Ahi Evran Üniversitesi 17 Mart 2006 yılında devlet üniversitesi statüsünde Kırşehir il sınırları içerisinde de kurulmuştur. 7 fakülte, 3 enstitü, 4 yüksekokul, 7 meslek yüksekokulu, 11 araştırma ve uygulama merkezini bünyesinde bulunduran üniversite “Yeni Türkiye\'nin Yenilikçi Üniversitesi” sloganıyla Cacabey, Bağbaşı, Aşık Paşa, Sağlık, Kaman, Mucur, Çiçekdağı, Boztepe ve Akpınar olmak üzere 9 yerleşkede 700\'den fazla akademik personeli ile 17.000 öğrencisine eğitim öğretim imkanı sağlamaktadır.', 'ahi-evran-universitesi', '34.15555', '39.137367', 'Kırşehir', NULL, '/m/0cpbf72');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(9, 'Akdeniz Üniversitesi', 'Akdeniz Üniversitesi Dumlupınar Bulvarı 07058 Kampus Antalya / TÜRKİYE', 'http://www.vektorelcizim.net/uploads/file/images/akdeniz_universitesi_yeni_logo.png', 'http://www.akdeniz.edu.tr', 'Akdeniz Üniversitesi 1982 yılında devlet üniversitesi statüsünde Antalya\'da kurulmuştur. 16 fakülte, 7 enstitü, 5 yüksekokul, 11 meslek yüksekokulu ve 43 araştırma ve uygulama merkezinde “Işık Saçan, Toplumu Aydınlatan, Bir Dünya Üniversitesi” sloganıyla 56916 öğrencisine 2549 akademik personeli ile eğitim öğretim vermektedir.', 'akdeniz-universitesi', '30.6399441', '36.8902799', 'Antalya', NULL, '/m/027j5lx');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(10, 'Aksaray Üniversitesi', 'Adana Yolu Üzeri E-90 Karayolu 7. Km Merkez Kampüs 68100 Aksaray / Türkiye', 'http://www.aksaray.edu.tr/files/logomuz_ve_oykusu/logo_renkli.jpg', 'http://www.aksaray.edu.tr/', 'Aksaray Üniversitesi 17 Mart 2006\'da Aksaray il sınırları içerisinde kurulmuştur. Merkez, Şereflikoçhisar, Ortaköy ve Güzelyurt\'ta olmak üzere 6 yerleşkesi bulunmaktadır. Üniversite, bünyesinde 9 fakülte, 4 yüksekokul, 7 meslek yüksekokulu, fen ve sosyal bilimler enstitüleri ve 11 araştırma merkezi ile faaliyet göstermektedir. Aksaray Üniversitesi 18.048 öğrencisine 721 akademik personeli ile evrensel düşünen yereli gözeten felsefesini savunarak eğitim öğretim imkanı sağlamaktadır.', 'aksaray-universitesi', '33.9809689', '38.3258008', 'Aksaray', NULL, '/m/0g9zg_0');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
