INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(12, 'Amasya Üniversitesi', 'Akbilek Mah. Muhsin Yazıcıoğlu Cad. No:7 PK: 05100 Merkez/AMASYA', 'http://sporakademisi.com/wp-content/uploads/2016/05/amasya-universitesi.jpg', 'http://www.amasya.edu.tr', 'Amasya Üniversitesi 01.03.2006 tarihinde Amasya\'da kurulmuştur. Üniversite bünyesinde 6 fakülte, 1 yüksekokul, 8 meslek yüksekokulu, 2 enstitüsünde 12816 öğrencisine 450 akademik personeli ile birlikte daha iyiye sloganıyla eğitim öğretim hizmeti vermektedir.', 'amasya-universitesi', '35.804925', '40.6537739', 'Amasya', NULL, '/m/0cnv4d8');
