INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(14, 'Ankara Üniversitesi', 'Ankara Üniversitesi Rektörlüğü, Dögol Caddesi 06100, Tandoğan / Ankara / Türkiye', 'http://basimevi.ankara.edu.tr/files/2012/10/Ankara-%C3%9Cniversitesi.jpg', 'http://www.ankara.edu.tr', 'Ankara Üniversitesi, 1946 yılında  Atatürk ilke inkılâplarının dayanaklarını oluşturmak, bu ilke ve inkılâpları yurt geneline yaymak, kökleştirmek ve çağdaşlığın, bilimin ve aydınlığın ifadesi olan bu değerlerin yılmaz savunuculuğunu yapmak üzere, temeli bizzat yüce Atatürk tarafından atılan Ankara\'da kurulmuş bir devlet üniversitesidir. Ankara Üniversitesi’ne bağlı 5 yerleşkede,17 fakülte, 1 yüksekokul, 10 meslek yüksekokulu ve 1 Devlet Konservatuvarı, 13 enstitü ve 42 araştırma, uygulama ve eğitim merkezi bulunmakta ve bu birimlerde 68476 öğrenci öğrenim görmektedir. Nitelikli araştırmalar yapan, bilgi ve yeteneklerini insanlık ve ülke yararına kullanan ve evrensel düzeyde fark yaratarak geleceğe yön veren yenilikçi üniversite olma vizyonu ile hareket eden Ankara Üniversitesi bünyesinde 4293 akademik personel ile 5687 idari personel görev yapmaktadır.   ', 'ankara-universitesi', '32.831538', '39.9351287', 'Ankara', NULL, '/m/0679jh');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(15, 'Ardahan Üniversitesi', 'Ardahan Üniversitesi Yenisey Kampüsü, Çamlıçatak Mevkii, Ardahan 75000', 'http://ubys.ardahan.edu.tr/images/uniLogo.png', 'http://www.ardahan.edu.tr', 'Ardahan Üniversitesi, 22 Mayıs 2008 tarihinde Ardahan\'da kurulmuştur. Yenisey yerleşkesinde faaliyet gösteren ve Kafkas Üniversiteler Birliği\'ne üye olan 3889 öğrencinin öğrenim gördüğü Ardahan Üniversitesi\'nin bünyesinde 4 fakülte, 5 meslek yüksekokulu, 2 yüksekokul, 2 enstitü ve 5 araştırma merkezi bulunmaktadır. Işığa karışın sloganı ile eğitim öğretim hayatını sürdüren Ardahan Üniversitesi\'nde 287 akademik personel akademik faaliyetlerini sürdürmektedir.', 'ardahan-universitesi', NULL, NULL, 'Ardahan', NULL, '/m/0r8l58f');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(16, 'Artvin Çoruh Üniversitesi', 'Artvin Çoruh Üniversitesi Rektörlüğü 08100 Seyitler, Merkez, Artvin, Türkiye', 'http://vektorlogo.com/wp-content/uploads/2016/04/artvin-%C3%A7oruh-%C3%BCniversitesi-vektorel-cizim-logo.jpg', 'http://www.artvin.edu.tr', 'Artvin Çoruh Üniversitesi 17 Mayıs 2007 tarihinde birbirine 3 km uzaklıktaki iki ana yerleşke olan Şehir ve Seyitler Yerleşkeleri ile Hopa ilçesinde kurulan Hopa Yerleşkesi üzerinde devlet üniversitesi statüsünde göğe komşu topraklarda bir üniversite sloganıyla kurulmuştur. Artvin Çoruh Üniversitesi 7 fakülte, 6 meslek yüksekokulu, 2 enstitü, 1 yüksekokul ve 471 akademik personeli ile 7031 öğrenciye eğitim ve öğretim imkanı sağlamaktadır.', 'artvin-coruh-universitesi', NULL, NULL, 'Artvin', NULL, '/m/0r8m4fg');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(17, 'Atatürk Üniversitesi', 'Atatürk Üniversitesi Kampüsü, 25030, Türkiye', 'http://halittutuncu.com/wp-content/uploads/2015/07/atatu%CC%88rk-uni-logo.jpg', 'http://www.atauni.edu.tr', 'Atatürk Üniversitesi 7 Haziran 1957 tarihinde “verdiği eğitimin, ürettiği bilgive teknolojinin, sunduğu hizmetlerin dünyada öncelikli olarak talep edildiği bir üniversite olma vizyonuyla Erzurum\'da kurulmuş bir devlet üniversitesidir. Bölgesel ve ulusal düzeyde sürdürülebilir kalkınmaya katkıda bulunabilen, analiz ve sentez yapabilen, öğrendiğini uygulayabilen, sonuçlarını değerlendirebilen; iletişim, takım çalışması ve liderlik becerilerine sahip mezunları ve sorun çözebilen, uluslar arası düzeyde bilgi ve teknoloji üreten, öğretme ve öğrenme coşkusuna sahip çalışanları ile ürettiği bilgi ve hizmeti toplumun yararına sunmayı misyon edinmiş 155.561 öğrenim gördüğü üniversitenin, merkez kampüsü ve ilçelerindeki  yüksekokullarında bulunan 22 fakülte, 7 enstitü, 2 yüksekokul, 12 meslek yüksekokulu ve 20 araştırma merkezinde 2621 akademik personel akademik çalışmalarını sürdürmektedir.', 'ataturk-universitesi', '41.2556872', '39.9047608', 'Erzurum', NULL, '/m/03wg27h');
