INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(26, 'Balıkesir Üniversitesi', 'Balıkesir Üniversitesi Rektörlüğü Çağış Yerleşkesi (Bigadiç yolu üzeri 17. km) 10145, BALIKESİR', 'http://ieee.balikesir.edu.tr/images/baulogo.png', 'http://www.balikesir.edu.tr/', 'Balıkesir Üniversitesi, 11 Temmuz 1992 tarihinde Balıkesir il sınırları içerisinde kurulmuş bir devlet üniversitesidir. Üniversite Bigadiç yolu üzeride bulunan Çağış yerleşkesi ve ilçelere dağılmış olan yüksekokullarında faaliyet göstermektedir. Üniversite bünyesinde 11 fakülte, 5 yüksekokul, 16 meslek yüksek okulu, 5 enstitü ve 20 araştırma merkezi bulunmaktadır. “Eğitimde, Bilimde, Sanatta Çağdaş” sloganı ışığında eğitim ve öğretim veren üniversitede 1081 akademik personel görev almakta, 38.892 öğrenci ise öğrenim görmektedir.', 'balkesir-universitesi', '28.0031951', '39.5397069', 'Balıkesir', NULL, '/m/07s3pj2');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(27, 'Bandırma Onyedi Eylül Üniversitesi', 'Yeni Mahalle Şehit Astsubay Mustafa Soner Varlık Caddesi, No:77 Bandırma/BALIKESİR', 'http://bandirma.edu.tr/wp-content/themes/exclusive/images/default.png', 'http://www.bandirma.edu.tr', 'Bandırma Onyedi Eylül Üniversitesi, Balıkesir\'in Bandırma ilçesinde 2015 yılında devlet üniversitesi statüsünde kurulmuştur. Gönen yolu üzerinde bulunan üniversite, merkez kampüsü ve çevre ilçelerdeki binalarındaki 5 fakültesi, 4 enstitüsü, 1 yüksekokulu ve 4 meslek yüksekokulunda eğitim öğretim faaliyetlerini sürdürmektedir', 'bandrma-onyedi-eylul-universitesi', NULL, NULL, 'Balıkesir', NULL, NULL);
