INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(29, 'Batman Üniversitesi', 'Batman Üniversitesi, Merkez Kampüsü, 72060 Batman, Türkiye', 'http://www.freelogovectors.net/wp-content/uploads/2013/04/batman_universitesi_logo.jpg', 'http://www.batman.edu.tr', 'Batman Üniversitesi, 28 Mayıs 2007 tarihinde devlet üniversitesi statüsünde Batman\'da kurulmuştur. Batman Üniversitesi\'nin Merkez Kampüsü, Batı Raman Kampüsü, Kozluk Kampüsü ve Hasankeyf Kampüsü olmak üzere toplam 4 kampüsü bulunmaktadır. 7 fakülte, 3 ensititü, 4 yüksekokul, 4 meslek yüksekokulu, 8 araştırma merkezi bulunan üniversitede 400 akademisyen görev almakta ve 9600 öğrenci öğrenim görmektedir.', 'batman-universitesi', NULL, NULL, 'Batman', NULL, '/m/0cp4mmv');
