INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(31, 'Bilecik Şeyh Edebali Üniversitesi', 'Bilecik Şeyh Edebali Üniversitesi Rektörlüğü 11210 Gülümbe/BİLECİK', 'http://www.xsorgula.com/files/news/thumb/news-3bbf129374b65eaec997.jpg', 'http://www.bilecik.edu.tr/', 'Bilecik Şeyh Edebali Üniversitesi 29 Mayıs 2007 tarihinde, eğitim-öğretim ve bilimsel araştırmalar konusunda tercih edilen, kurumsal kimliği ve kültürü gelişmiş bir üniversite olarak bilim dünyasına katkı sağlama vizyonuyla Bilecik il sınırları içerisinde devlet üniversitesi olarak kurulmuştur. Merkez kampüsü Gülümbe\'de bulunan üniversite meslek yüksekokulları ile Bilecik\'in ilçelerine yayılım göstermiştir. İlim ve fen için kayıt ve şart yoktur sloganı ışığında eğitim faaliyetlerini sürdüren üniversitenin bünyesinde 5 fakülte, 2 enstitü, 2 yüksekokul ve 7 meslek yüksekokulu bulunmaktadır. Bu eğitim birimlerinde 13863 öğrenci öğrenim görmekte, 455 akademik personel de bu birimlerde çalışmalarını sürdürmektedir.', 'bilecik-seyh-edebali-universitesi', NULL, NULL, 'Bilecik', NULL, '/m/0r8m1bg');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(32, 'Bingöl Üniversitesi', 'Selahaddin-i Eyyubi Mah. Aydınlık Cad. No: 1 Posta Kodu: 12000, Bingöl/TÜRKİYE', 'http://www.bingol.edu.tr/documents/file/bu_BilgolUniverstyLogo/5-300-b8a17557-c808-48cf-9ffe-e0c8098ee96a.jpg', 'http://www.bingol.edu.tr', 'Bingöl Üniversitesi 29 Mayıs 2007 tarihinde Bingöl il sınırları içerisinde bilimsel faaliyetleriyle birlikte, içinde bulunduğu toplumun gerçeklerinin farkında ve değerleriyle barışık olarak toplumla güçlü ilişkiler kuran, bölgesel kaynakları en ideal biçimde kullanıp sürdürülebilir kalkınmayla birlikte insan odaklı rekabet gücünü artıran, yükseköğretimde çağın gereklerine yönelik adımlar atan ve bilimsel değerleri kendine rehber edinen ve özümseyen bir üniversite olma vizyonuyla devlet üniversitesi olarak kurulmuştur.Tek bir ana yerleşkede hizmet veren üniversitenin bünyesinde 7 Fakülte, 3 Yüksekokul, 5 Meslek Yüksekokulu ve 4 Enstitü birimi bulunmaktadır. Bu birimlerde 11065 öğrenci öğrenim görmekte, 484 akademik personel de çalışmalarını yürütmektedir.', 'bingol-universitesi', NULL, NULL, 'Bingöl', NULL, '/m/0r8lt74');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(33, 'Bitlis Eren Üniversitesi', 'Rahva Yerleşkesi Beş Minare Mah. Ahmet Eren Bulvarı 13000 Merkez/Bitlis', 'http://bebap.beu.edu.tr/themes/t-bitlis/images/e-icon.png', 'http://www.beu.edu.tr/Default.aspx', '', 'bitlis-eren-universitesi', NULL, NULL, 'Bitlis', NULL, '/m/0r8qj32');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(34, 'Boğaziçi Üniversitesi', 'Boğaziçi Üniversitesi 34342 Bebek/İstanbul Türkiye', 'http://www.logomuz.com/dosyalar/resim/bogazici-universitesi-1282219375.jpg', 'http://www.boun.edu.tr', 'Boğaziçi Üniversitesi, Amerika Birleşik Devletleri sınırları dışında kurulan ilk yükseköğretim kurumu olan Robert Kolej adıyla 1863 yılında kurulmuştur. 1971 yılında ise Boğaziçi Üniversitesi’ne dönüşerek  Kolej’in eğitim geleneğini ve öğretim dili olarak da İngilizceyi koruyarak seçkin bir Türk kamu araştırma üniversitesi haline gelmiştir. O zamandan beri hem lisans ve hem de lisansüstü programlarını genişleten ve bünyesine yeni kampüsler ekleyen Boğaziçi Üniversitesi, şu anda temel ve sosyal bilimler, mühendislik, eğitim ve uygulamalı bilim dallarında üstün lisans ve lisansüstü programları ile Türkiye\'nin önde gelen üniversitelerinden biridir. Dünya standartlarında sağladığı öğretim kalitesiyle, birinci sınıf laboratuvarları ve araştırma merkezleri ve nefes kesen kampüsüyle Türkiye\'nin ve bölge ülkeleri öğrencilerinin en çok tercih ettiği üniversite olmuştur. 3800’den fazlası lisansüstü öğrenci olmak üzere toplam öğrenci sayısı 15.000’e ulaşmıştır. Boğaziçi Üniversitesi,  32 ayrı akademik bölümü, altı lisansüstü enstitüsü ve 19 araştırma merkezi ile geniş bir yelpazede tüm disiplinleri kapsayan, yüksek etkili araştırmalar sürdürmektedir. Üniversitenin bu araştırma faaliyetleri için ulusal ve uluslararası araştırma fonu kuruluşlarının yanı sıra sanayiden de araştırma fonu desteği sağlanmaktadır. Dünya çapında önde gelen akademik kurumlarla yaptığı ortaklıklar neticesinde ise üniversitenin araştırmacı kimliği önemli oranda güçlenmiştir.', 'bogazici-universitesi', '29.051893', '41.08337', 'İstanbul', NULL, '/m/02vxmh');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(35, 'Bozok Üniversitesi', 'Şeyh Osman Mh., Bozok Üniversitesi Rektörlüğü, Yozgat, Türkiye', 'http://www.bozok.edu.tr/images/500px-bozok_universitesi.jpg', 'http://www.bozok.edu.tr/', 'Bozok Üniversitesi, 1 Mart 2006 tarihinde Yozgat\'ta kurulmuş devlet üniversitesidir. Merkez kampüsünün Akdağ Kampüsü olduğu Üniversite\'de rektörlük gibi idari binalar Yozgat şehir merkezinde, meslek yüksekokulları ise çevre ilçelerde bulunmaktadır. Üniversite bünyesinde bulunan 9 fakülte, 4 yüksekokul, 6 meslek yüksekokulu 3 enstitü, 7 uygulama ve araştırma Merkezi\'nde toplam 12.095 öğrencisine 706 akademik personeli ile eğitim vermektedir.', 'bozok-universitesi', NULL, NULL, 'Yozgat', NULL, '/m/0134gmwz');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(36, 'Bülent Ecevit Üniversitesi', 'Bülent Ecevit Üniversitesi Rektörlüğü PK:67100 İncivez/ZONGULDAK', 'http://i.internethaber.com/files/2016/1/24/1559847/1559847.jpg?v=1453628312KdQuo5KUOX', 'http://www.beun.edu.tr', 'Bülent Ecevit Üniversitesi 1992 yılında Zonguldak Karaelmas Üniversitesi adıyla Zonguldak\'ta kurulmuş bir devlet üniversitesidir. Üniversitenin İncirharmanı Yerleşkesi, Çaycuma M.Y.O Yerleşkesi ve çevre ilçelerinde bulunan meslek yüksekokulu binaları mevcuttur. Bünyesinde bulunan 11 fakülte, 5 yüksekokul, 7 meslek yüksekokulu 3 enstitü, 1 devlet konservatuvarı ve 29 Uygulama ve Araştırma Merkezi\'nde 26.503 öğrencisine 1122 akademik ve 1238 idari personeli ile ulusal ve uluslararası düzeyde eğitim-öğretim hizmeti verme, bilimsel araştırmalar yapma ve bilimi, teknolojiyi, sanatı ve kültürel değerleri girişimci bir üniversite olarak insanlığın hizmetine sunma misyonunu benimseyerek eğitim vermektedir.', 'bulent-ecevit-universitesi', NULL, NULL, 'Zonguldak', NULL, '/m/0cp4ml0');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(37, 'Bursa Teknik Üniversitesi', 'Eğitim Cd., 16330 Yıldırım, Türkiye', 'http://depo.btu.edu.tr/dosyalar/btu/Dosyalar/TR%20LOGO(1).jpg', 'http://www.btu.edu.tr', 'Bursa Teknik Üniversitesi 21 Temmuz 2010 tarihinde teknik üniversite olarak devlet üniversitesi statüsünde Ulusal ve uluslararası alanda eğitim, öğretim ve araştırma kalitesi ile tercih edilen yenilikçi ve girişimci bir üniversite olma vizyonuyla Bursa\'da kurulmuştur. Merkez yerleşkesi Yıldırım olan üniversitenin Merinos ve Osmangazi\'de de yerleşkeleri bulunmaktadır. Bünyesinde 6 Fakülte, 2 Enstitü ve 1 Yüksek okul ve 2 araştırma ve uygulama merkezi bulunan üniversitede 152 akademik personel görev almaktadır. Bursa Teknik Üniversitesi\'nde 712 öğrenci öğrenim görmektedir.', 'bursa-teknik-universitesi', NULL, NULL, 'Bursa', NULL, '/m/0h7lcc0');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(38, 'Çanakkale Onsekiz Mart Üniversitesi', 'Çanakkale Onsekiz Mart Üniversitesi - ÇANAKKALE / TÜRKİYE', 'http://bidb.comu.edu.tr/comu_logo_3.png', 'http://www.comu.edu.tr', 'Çanakkale 18 Mart Üniversitesi 3 Temmuz 1992 Tarihinde Çanakkale’de Devlet Üniversitesi Statüsünde sürdürülebilir performansı ve gelişmeyi referans yapan üniversite olma Misyonu ve uluslararası akademik topluluklar ile sürdürülebilir etkileşim sağlayan dünya üniversitesi olma vizyonuyla kurulmuştur. Ana yerleşkesi Terzioğlu Yerleşkesi olan üniversitenin Anafartalar, Dardanos, Sarıcaeli ve Ağaköy yerleşkeleri bulunmaktadır. Bünyesinde bulunan 12 Fakülte, 12 Meslek Yüksekokulu, 8 Yüksekokul, 4 Enstitü ve 22 araştırma ve uygulama merkezinde 1600 akademik personel görev almaktadır. 42.436 öğrenci ise bu birimlerde öğrenim görmektedir.', 'canakkale-onsekiz-mart-universitesi', '26.4107054', '40.1065248', 'Çanakkale', NULL, '/m/0bzd0b');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(39, 'Çankırı Karatekin Üniversitesi', 'Uluyazı Kampüsü Rektörlük Binası, MERKEZ / ÇANKIRI', 'http://karatekin.edu.tr/dosyalar/2010/aralik/image/odul.jpg', 'http://www.karatekin.edu.tr/', 'Çankırı Karatekin Üniversitesi 28 Mayıs 2007 tarihinde yenilikçi, uluslararası düzeyde eğitim-öğretim ve araştırmada öncü; öğrenciler, araştırmacılar ve çalışanlar tarafından tercih edilen bir kurum olma vizyonunu benimseyerek “Güler yüzlü üniversite” sloganı ile Çankırı\'da kurulmuştur. Uluyazı Kampüsü\'nde faaliyetlerini yürüten üniversitenin bünyesinde 6 Fakülte, 4 Meslek Yüksekokulu, 2 Yüksekokul, 4 Enstitü ve 7 araştırma ve uygulama merkezi bulunmaktadır. Bu birimlerde 611 öğretim elemanı görev almakta, 10573 öğrenci öğrenim görmektedir.', 'cankr-karatekin-universitesi', '33.617002', '40.598328', 'Çankırı', NULL, '/m/0r8pz72');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(40, 'Celâl Bayar Üniversitesi', 'Muradiye Kampüsü 45140 - Yunusemre - MANİSA', 'http://seeklogo.com/images/C/celal-bayar-universitesi-logo-C06A2C4CE1-seeklogo.com.gif', 'http://www.cbu.edu.tr', 'Celal Bayar Üniversitesi 11 Temmuz 1992 tarihinde Manisa\'da devlet üniversitesi statüsünde bilimde, eğitimde ve hizmette uluslararası saygınlığı olan bir üniversite haline gelme vizyonu ile kurulmuştur. 10 fakülte, 5 yüksekokul, 15 meslek yüksekokulu, 3 enstitüsü, 22 araştırma uygulama merkezi bulunan üniversitede 1.581 akademisyen görev almakta ve 48.607 öğrenci öğrenim görmektedir. Celal Bayar Üniversitesi, ulusal kimliğini küresel değerlerle bağdaştırabilen, kendisini sürekli geliştirebilen, teknolojiye hakim, girişimci, çevreye ve topluma saygılı, eleştirel düşünme becerisine sahip, insan hakları, demokrasi, etik ve kültürel değerler konusunda duyarlı mezunlar yetiştirmek; bilime ve teknolojiye uluslararası düzeyde katkıda bulunacak araştırmalar yapmak, bu araştırmaları yapacak kadroları yetiştirmek ve gerekli altyapıyı oluşturmak; araştırma, eğitim ve hizmet alanlarındaki üretimini toplum yararına sunma amacıyla eğitim öğretim hayatını sürdürmeye devam etmektedir.', 'celal-bayar-universitesi', NULL, NULL, 'Manisa', NULL, '/m/047dj_k');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(41, 'Çukurova Üniversitesi', 'Çukurova Üniversitesi Rektörlüğü 01330 Balcalı, Sarıçam / ADANA', 'http://www.cu.edu.tr/upload/cukurova_logo.png', 'http://www.cu.edu.tr/', 'Çukurova Üniversitesi Ankara ve Atatürk Üniversitelerine bağlı olarak 30.11.1973 tarihinde Adana’da kurulmuştur. Seyhan gölü kıyısındaki Balcalı Kampüsü’nde eğitim-öğretim veren üniversite bünyesinde 17 fakülte, 4 yüksekokul, 12 meslek yüksekokulu, 1 devlet konservatuvarı, 3 enstitü ve 32 araştırma ve uygulama merkezi bulunmaktadır. Bu birimlerde 2186 akademik personel, 49.711 öğrencinin eğitim ve öğretiminde görev almaktadır.', 'cukurova-universitesi', '35.3601254', '37.0551405', 'Adana', NULL, '/m/0448dj');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(42, 'Cumhuriyet Üniversitesi', 'Cumhuriyet Üniversitesi 58140 KAMPÜS/SİVAS', 'http://logovector.org/wp-content/uploads/logos/png/s/sivas_cumhuriyet_universitesi_logo.png', 'http://www.cumhuriyet.edu.tr/', 'Cumhuriyet Üniversitesi 9 Şubat 1974 tarihinde ulusal ve uluslar arası düzeyde eğitim-öğretim, araştırma ve mesleki alanda tanınırlık ve saygınlık, örgütsel bağları güçlü, kurumsal kültürü ve kimliği gelişmiş üretken, toplumsal ve ek ihtiyaçlara cevap veren bölgesinde lider üniversite olma vizyonuyla Sivas’ta devlet üniversitesi statüsünde kurulmuştur. Sivas merkezde bulunan Merkez yerleşkesinin yanı sıra çevre ilçelerde meslek yüksekokulları konumlanan Cumhuriyet Üniversitesi’nin bünyesinde, 16 Fakülte, 4 Enstitü, 1 devlet konservatuvarı, 5 Yüksekokul, 14 Meslek Yüksekokulu bulunmaktadır. Bu birimlerde 1789 akademik personel ve 1602 idari personel görev almaktadır. Cumhuriyet Üniversitesi bünyesinde öğrenim gören öğrenci sayısı ise 53.000\'dir.', 'cumhuriyet-universitesi', '37.0110269', '39.7101036', 'Sivas', NULL, '/m/04ld3m7');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(43, 'Deniz Harp Okulu', 'Deniz Harp Okulu Komutanlığı 34942 Tuzla / İSTANBUL', 'http://www.e-marineeducation.com/tr/wp-content/uploads/Deniz-Harp-Okulu-Logosu.png', 'https://www.dho.edu.tr/', '', 'deniz-harp-okulu', NULL, NULL, 'İstanbul', NULL, '/m/02pvl2v');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(44, 'Dicle Üniversitesi', 'Dicle Üniversitesi Rektörlüğü, 21280-Diyarbakır.', 'http://www.dicle.edu.tr/Contents/c1dcaadc-b976-499a-84e7-d71871668193.gif', 'http://www.dicle.edu.tr', 'Dicle Üniversitesi 1974 yılında bölgesine, ülkesine ve evrensel bilime katkıda bulunacak bir araştırma üniversitesi olma vizyonu ile Diyarbakır il sınırları içerisinde devlet üniversitesi statüsünde kurulmuştur. Dicle Üniversitesi bünyesinde 14 fakülte, 4 yüksekokul, 11 meslek yüksekokulu ve 4 enstitüsü, teknokent, 24 Araştırma ve Uygulama Merkezi bulunmaktadır. Bu birimlerde faaliyetlerini yürüten 3600 civarında kadrolu akademik ve idari elemanı ile Dicle Üniversitesi, yaklaşık olarak 30.000 öğrenciye evrensel değerleri temel alarak yaptığı eğitim, öğretim ve araştırma faaliyetleriyle her alanda yetkin, yaratıcı, girişimci, ahlaki değer ve toplumsal sorumluluk sahibi üstün nitelikli bireyler yetiştirme, topluma ve çevreye duyarlı yüksek nitelikli bilimsel ve kültürel çalışmalar yapma ve insanlığın yararına sunma amacıyla eğitim vermektedir.', 'dicle-universitesi', NULL, NULL, 'Diyarbakır', NULL, '/m/0ds0828');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
