INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(46, 'Dokuz Eylül Üniversitesi', 'DOKUZ EYLÜL ÜNİVERSİTESİ REKTÖRLÜĞÜ Cumhuriyet Bulvarı No: 144 35210 Alsancak / İZMİR', 'http://logovector.org/wp-content/uploads/logos/png/d/dokuz_eylul_universitesi_logo.png', 'http://www.deu.edu.tr', 'Dokuz Eylül Üniversitesi 20 Temmuz 1982`de İzmir il sınırları içerisinde kurulmuştur. Rektörlük yerleşkesinin Alsancak’ta bulunduğu üniversitenin İnciraltı, Tınaztepe, Dokuzçeşmeler yerleşkesi ile toplamda 4 yerleşkesi bulunmaktadır. Üniversite bünyesinde bulunan 14 Fakülte, 4 Yüksekokul, 7 Meslek Yüksekokulu, 1 Konservatuvar, 10 Enstitü ve 54 Uygulama ve Araştırma Merkezi\'nde 3.324 akademik personel çalışmalarını yürütmekte, 62.663 öğrenci de öğrenim görmektedir.', 'dokuz-eylul-universitesi', '27.2097254', '38.3685103', 'İzmir', NULL, '/m/063hy9');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(47, 'Dumlupınar Üniversitesi', 'Evliya Çelebi Yerleşkesi Tavşanlı Yolu 10.km Kütahya / Türkiye', 'http://www.dumlupinar.edu.tr/app/views/panel/ckfinder/userfiles/1/images/logolar/dpu_logo_1.png', 'http://dumlupinar.edu.tr', 'Dumlupınar Üniversitesi, 03.07.1992 tarihinde Kütahya\'da mesleki bilgi ve tecrübelerini insanlığın huzur ve mutluluğu için kullanacak, vatanı ve milleti için fedakârca çalışacak, yüksek mesleki donanıma sahip nesiller yetiştiren eğitim öğretim kurumu olma ve bilim, sanat, kültür, spor ve sağlık alanlarında kendini sürekli geliştiren, diğer üniversitelerle rekabet gücü yüksek, nitelikli, yenilikçi eğitim öğretim kurumu olma vizyonuyla kurulmuştur. Dumlupınar Üniversitesi, Kütahya il merkezinde: Evliya Çelebi Merkez ve Germiyan Yerleşkesi olmak üzere iki yerleşkeye, 11 ilçede de ayrı bina ve yerleşke alanlarına sahiptir. Üniversite bünyesinde bulunan 10 fakülte, 4 yüksekokul; 4 enstitü, 12 meslek yüksekokulu ve 24 araştırma ve uygulama merkezinde 1216 akademik personel çalışmalarını yürütmekte, 49944 öğrenci de öğrenim görmektedir.', 'dumlupnar-universitesi', NULL, NULL, 'Kütahya', NULL, '/m/026j72d');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(48, 'Düzce Üniversitesi', 'Düzce Üniversitesi Konuralp Yerleşkesi Konuralp, Merkez/Düzce 81620', 'http://www.duzce.edu.tr/dosya/logo/DUE.jpg', 'http://www.duzce.edu.tr/', 'Düzce Üniversitesi 17 Mart 2006 tarihinde Düzce il sınırları içerisinde toplumsal ve sürdürülebilir kalkınma alanlarında disiplinler arası proje işbirlikleriyle öncü, eğitim-öğretim ve bilimsel gelişme alanlarında ulusal ve uluslararası düzeyde tanınan, çağdaş, yenilikçi, güvenilir, saygın ve tercih edilen bir üniversite olma vizyonuyla kurulmuştur. 11 fakültesi, 4 yüksekokulu, 9 meslek yüksekokulu, 3 enstitüsü, 4 araştırma merkezi bulunan Düzce Üniversitesi\'nde 1.400 akademik personel bilimsel çalışmalarını Atatürk ilke ve devrimlerine bağlı, ülkenin gelişmesine ve çağdaş uygarlık seviyesine ulaşmasına katkı sağlayacak meslek insanları yetiştirme, araştırma ve topluma hizmet alanlarında evrensel değerler üretme, ulusal ve uluslararası düzeyde iş birlikleri kurma, sürdürülebilir kalkınmaya öncülük misyonuyla yürütmektedir. Konuralp Yerleşkesi\'nde konumlanan üniversitenin çevre ilçelerde meslek yüksekokulları mevcuttur. Düzce Üniversitesi\'nde 20.000 kadar öğrenci öğrenim görme imkanı bulmaktadır.', 'duzce-universitesi', '31.17547', '40.902898', 'Düzce', NULL, '/m/0r8n744');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(49, 'Ege Üniversitesi', 'Ege Üniversitesi Kampüsü 35100, Bornova-İZMİR', 'http://www.egelogo.ege.edu.tr/download/diger/ege60/ege60.png', 'http://www.ege.edu.tr/', '', 'ege-universitesi', '27.2243178', '38.4573028', 'İzmir', NULL, '/m/0ctt6c');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(50, 'Erciyes Üniversitesi', 'Erciyes Üniversitesi Rektörlüğü 38039 Kayseri - Türkiye', 'http://guzelsanat.erciyes.edu.tr/logolar/e_u_logo_jpg_96dpi_RGB.jpg', 'http://en.erciyes.edu.tr/', 'Erciyes Üniversitesi 1978 yılında Kayseri\'de devlet üniversitesi statüsünde bilimsel çalışmalara, bilgi ve teknoloji üretimine ve sosyal, kültürel, sanat ile spor alanlarına katkı sağlayan; uluslararası nitelikte öğrenci ve öğretim elemanı yapısına sahip; bünyesinde Türkiye’de önde gelen ve Dünya\'da saygın araştırma merkezleri bulunduran; yerel, evrensel ve etik değerlere sahip öncü bir üniversite olma vizyonuyla Kayseri\'de kurulmuştur. Kayseri Merkez Kampüsü, Seyrani, Tomarza olmak üzere 3 yerleşkesi bulunan üniversitenin bünyesinde 18 fakülte, 3 yüksekokul, 9 meslek yüksekokulu, 7 enstitü, 6 bölüm, 38 araştırma merkezi faaliyet göstermektedir. Üniversitede, 2014 - 2015 öğretim yılı itibariyle 2300\'e yakın akademik personel görev yapmakta olup yaklaşık 50.000 öğrenci de eğitim almaktadır.', 'erciyes-universitesi', '35.5235473', '38.7005635', 'Kayseri', NULL, '/m/09yxhj');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(51, 'Erzincan Üniversitesi', 'Erzincan Üniversitesi Rektörlüğü Fatih Mahallesi 24100-ERZİNCAN', 'http://eski.erzincan.edu.tr/userfiles/menu/images/Erznc_%20%DCni.jpg', 'http://www.erzincan.edu.tr', 'Erzincan Üniversitesi 11.07.1992 tarihinde Anadolu’da bir dünya üniversitesi olma vizyonuyla Erzincan il sınırları içerisinde kurulmuştur. Erzincan merkezde bulunan rektörlük binası, Yalnızbağ Yerleşkesi, meslek yüksekokulu ve yüksekokul binaları ile üniversitenin yerleşkeleri Erzincan il sınırları içerisinde dağılım göstermiştir. Üniversite bünyesinde 9 fakülte, 3 enstitü, 5 yüksekokul, 11 meslek yüksekokulu ve 20 araştırma ve uygulama merkezi bulunmaktadır. Bu birimlerde 19.500 öğrenci öğrenim görmektedir. 855 Akademik Personel, 372 İdari Personeli ile Erzincan Üniversitesi, insan merkezli bir eğitim anlayışıyla, bilimi ve aklı esas alarak ülkemizin değerleri ve hedefleri doğrultusunda üstün nitelikli bireyler yetiştirme; uluslararası ölçekte bilim ve teknoloji üreterek bölgenin ve ülkenin sürdürülebilir kalkınmasına katkıda bulunma ve toplumun sorunlarını çözmeye yönelik çalışmalar yapma misyonuyla eğitim hayatını sürdürmektedir.', 'erzincan-universitesi', NULL, NULL, 'Erzincan', NULL, '/m/0br_gkk');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(52, 'Erzurum Teknik Üniversitesi', 'Çat Yolu Üzeri 4. Km / Erzurum', 'http://www.tasarimyarismalari.com/wp-content/uploads/2012/05/etu-logo-3.jpg', 'http://www.erzurum.edu.tr/', 'Erzurum Teknik Üniversitesi, Erzurum’da ikinci bir devlet üniversitesi olarak 21.07.2010 tarihinde toplumla iletişim halinde bulunarak bölgenin problemlerine bilimsel çözümler üretecek sosyal ve ekonomik çalışmalar yapan, yaşam boyu öğrenmeyi temel ilke kabul ederek bilginin ve sanatın tüm toplum katmanlarına yayılmasına katkıda bulunan ve bölgesinde yüksek teknoloji konularında araştırma altyapısı eksikliğini gidererek ileri teknoloji konularında araştırma üssü olmayı hedefleyen bir Dünya Üniversitesi olma amacıyla kurulmuştur. Çat yolu 4. Km\'deki rektörlük binasının yanı sıra Havalimanı Yolu Üzeri\'ndeki derslikler binası ile çalışmalarını yürüten üniversitenin merkez kampüs inşaatı sürmektedir. 6 fakülte, 3 enstitü ve 1 yüksekokulun bulunduğu üniversitede 173 akademik personel görev almakta, 1835 öğrenci öğrenim görmektedir.', 'erzurum-teknik-universitesi', NULL, NULL, 'Erzurum', NULL, '/m/0r8nn3k');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(53, 'Eskişehir Osmangazi Üniversitesi', 'Meşelik Kampüsü, Atatürk Bulv., Osmangazi, 26480 Eskişehir, Türkiye', 'http://yos.ogu.edu.tr/images/logo.png', 'http://www.ogu.edu.tr', 'Eskişehir Osmangazi Üniversitesi, 18 Ağustos 1993\'de Eskişehir\'de Ulusal ve evrensel değerlere sahip, bilim ışığında araştırma-geliştirme yapabilen, girişimci, katılımcı, paylaşımcı, bilim ve teknoloji üreterek topluma katkı sağlayan mezunlar ve bilim insanları yetiştiren, çağdaş hizmetler sunan, çalışanlarının haklarını koruyan ve onlara saygılı, ulusal ve uluslararası düzeyde saygınlığı olan, alanında öncülük eden ve çalışmaları örnek alınan bir üniversite olma vizyonu ile Eskişehir\'de kurulmuştur. Merkez yerleşkesi Meşelik olan üniversitenin, Bademlik, Çamlık, Ali Numan Kıraç, Organize Sanayi Bölgesi, Sivrihisar, Mahmudiye olmak üzere 7 yerleşkesi bulunmaktadır. Üniversite bünyesinde 10 fakülte, 2 yüksekokul, 4 meslek yüksekokulu, 5 enstitü, 27 araştırma ve uygulama merkezi bulunmaktadır. Bu birimlerde 29.000 öğrenci öğrenim görmektedir.', 'eskisehir-osmangazi-universitesi', '30.4849402', '39.7510832', 'Eskişehir', NULL, '/m/02qfpv5');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(54, 'Fırat Üniversitesi', '', 'http://logovector.org/wp-content/uploads/logos/png/f/firat_universitesi_logo.png', 'http://www.firat.edu.tr/', 'Fırat Üniversitesi 1975 yılında bilimin parlayan yıldızı sloganıyla Elazığ\'da devlet üniversitesi olarak kurulmuştur. Elazığ Merkez\'de bulunan kampüsü ve çevre ilçelerindeki meslek yüksek okulları ile faaliyetlerini sürdürmektedir. 36091 öğrencinin öğrenim gördüğü üniversite bünyesinde 14 Fakülte, 4 Yüksekokul, 1 Devlet Konservatuarı, 9 Meslek Yüksekokulu, 4 Enstitü, 23 araştırma ve uygulama merkezi ve bu birimlerde akademik faaliyetlerini sürdüten 1697 öğretim üyesi bulunmaktadır.', 'frat-universitesi', '39.2054067', '38.6776247', 'Elazığ', NULL, '/m/03mgm2_');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(55, 'Galatasaray Üniversitesi', 'Çırağan Cad. No:36, 34349 Ortaköy/İstanbul', 'http://istanbuletkinlik.net/wp-content/uploads/2016/03/galatasaray-%C3%BCniversitesi-bahar-%C5%9Fenlikleri-%C5%9Fenli%C4%9Fi-2016.jpeg', 'http://www.gsu.edu.tr/', '', 'galatasaray-universitesi', NULL, NULL, 'İstanbul', NULL, '/m/0283zqx');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(56, 'Gazi Üniversitesi', 'Gazi Üniversitesi Rektörlüğü, 06500 Teknikokullar ANKARA', 'http://www.freelogovectors.net/wp-content/uploads/2013/04/gazi_universitesi_logo.jpg', 'http://gazi.edu.tr/', 'Gazi Üniversitesi, Cumhuriyet tarihinin ilk üniversitesi olarak 1926 yılında Ankara\'da devlet üniversitesi olarak, bilim ve teknolojiden sanat ve spora kadar uzanan geniş bir yelpazede özgün araştırmaları, üst düzey eğitimi, yaratıcı faaliyetleri ve topluma hizmeti ile ulusal ve uluslararası düzeyde saygın ve lider bir üniversite olma vizyonuyla kuruldu. Rektörlük binasının bulunduğu Merkez Yerleşkesi ile beraber Beşevler, Emek, Maltepe, Gölbaşı, Çubuk, Ostim ve Polatlı olmak üzere toplam 8 yerleşkesi bulunan, 77 bin öğrencinin öğrenim gördüğü üniversite 21 fakültesi, 4 yüksekokulu, 1 Türk Müziği Devlet Konservatuvarı, 11 meslek yüksekokulu, 48 araştırma merkezi ve 7 enstitüsü bünyesinde çalışan 4000 akademik personeli ile Gazi Üniversitesi adını aldığı Gazi Mustafa Kemal Atatürk\'e yaraşır bir yüksek öğretim kurumu olma iddiasını devam ettirmektedir.', 'gazi-universitesi', '32.8225332', '39.9400862', 'Ankara', NULL, '/m/07h638');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(57, 'Gaziantep Üniversitesi', 'Üniversite Bulvarı 27310 Şehitkamil - Gaziantep, TÜRKİYE', 'http://www.freelogovectors.net/wp-content/uploads/2012/06/gaziantep-universitesi-logo1.jpg', 'http://www.gantep.edu.tr', '', 'gaziantep-universitesi', '37.3134478', '37.0359319', 'Gaziantep', NULL, '/m/0dcw27');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(58, 'Gaziosmanpaşa Üniversitesi', 'Gaziosmanpaşa Üniversitesi, 60250 Tokat / TÜRKİYE', 'http://danismendsempozyumu.gop.edu.tr/images/gop_logo.jpg', 'http://www.gop.edu.tr', 'Adını Plevne Kahramanı Gazi Osman Paşa\'dan alan Üniversite 03.07.1992 tarihinde Tokat il sınırları içerisinde devlet üniversitesi statüsünde, eğitim, araştırma ve uygulamada ülkemizde önde gelen ve uluslararası düzeyde tanınan bir üniversite olma misyonuyla kurulmuştur. Taşlı Çiftlik Kampüsü\'nde faaliyetlerini sürdüren üniversitenin bünyesinde Şehir Yerleşkesin\'in yanı sıra çevre ilçelerde meslek yüksekokulları bulunmaktadır. 11 fakülte, 11 yüksekokul, 15 meslek yüksekokulu, 4 enstitü, 13 araştırma ve uygulama merkezinin bulunduğu üniversitede 28.645 öğrenim görmektedir. Evrensel değerlere sahip, insana, topluma ve doğaya saygılı, donanımlı, ülkenin sosyokültürel ve ekonomik gelişimine katkı sağlayacak bireyler yetiştirme, ulusal ve uluslararası sorunlara çözümler üretme, üniversitenin birikimlerini insanlığın hizmetine sunma misyonuyla hareket eden üniversitede 1130 akademik personel çalışma yürütmektedir.', 'gaziosmanpasa-universitesi', '36.546463', '40.325182', 'Tokat', NULL, '/m/0h0gkd');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(59, 'Gebze Teknik Üniversitesi', 'Gebze Teknik Üniversitesi Rektörlüğü, P.K: 141 41400 Gebze/KOCAELİ ', 'http://www.gtu.edu.tr/files/html/mobil/gtu_logo_tr_500.png', 'http://www.gyte.edu.tr/', 'Gebze Teknik Üniversitesi 11 Temmuz 1992 tarihinde araştırma ve teknoloji üretimi öncelikli bir ihtisas üniversitesi olarak Kocaeli il sınırları içerisinde Dünya’da saygın üniversiteler arasında yer alan bir ihtisas üniversitesi olma vizyonuyla devlet üniversitesi statüsünde kurulmuştur. Bünyesinde bulunan 4 fakülte, 10 enstitü ve 4 araştırma ve uygulama merkezinde 5000 öğrenci eğitim görmektedir. 165 doktoralı öğretim elemanının çalıştığı üniversitede, bilimselliğinin ve üretkenliğinin göstergelerinden biri olan öğretim üyesi başına düşen uluslararası yayın sayısı bakımından devlet üniversiteleri arasında ilk sıralarda yer almaktadır. Gebze Teknik Üniversitesi, Dünya standartlarında lisans ve lisansüstü seviyede eğitim vermeyi, temel ve uygulamalı bilimsel ve teknolojik araştırmalar yapmayı ve bunları saygın uluslararası dergi ve kitaplarda yayınlamayı temel varlık sebebi olarak kabul etmiştir.', 'gebze-teknik-universitesi', '29.36524', '40.8089868', 'Kocaeli', NULL, '/m/02rgmyg');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(60, 'Giresun Üniversitesi', 'Güre, 28200 Gaziler / Merkez/Giresun Merkez/Giresun, TÜRKİYE', 'http://www.resimle.net/data/media/350/Giresun__universitesi_logosu_amblemi.JPG', 'http://www.giresun.edu.tr/', 'Giresun Üniversitesi Giresun Üniversitesi, 2006 yılında bağlı olduğu KTÜ\'den ayrılarak Giresun\'da yaşanacak değişim ve gelişmelerle oluşacak yarının eğitim, bilim ve teknoloji dünyasında uluslararası öneme sahip bir bilgi limanı olma vizyonuyla açılan devlet üniversitesidir. Giresun Üniversitesi, Merkez, Güre, Gazipaşa, Nizamiye, Piraziz, Bulancak, Keşap, Espiye, Tirebolu, Görele, Eynesil, Dereli, Alucra, Şebinkarahisar olmak üzere 10 yerleşkede eğitim öğretim faaliyetlerini sürdürmektedir. Giresun Üniversitesi bünyesinde 10 Fakülte, 11 Meslek Yüksekokulu, 5 Yüksekokul, 3 Enstitü, 1 Devlet Konservatuvarı ve 15 araştırma ve uygulama merkezi bulunmaktadır. Bu birimlerde 28105 öğrenci öğrenim görmektedir.', 'giresun-universitesi', '38.322605', '40.9144389', 'Giresun', NULL, '/m/02q06k_');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
