INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(62, 'Gümüşhane Üniversitesi', 'Bağlarbaşı Mahallesi 29100 / Gümüşhane', 'http://www.gumushane.edu.tr/logolar/ghu_logo_b1.jpg', 'http://www.gumushane.edu.tr', 'Gümüşhane Üniversitesi 31 Mayıs 2008 tarihinde Gümüşhane ilinde kurulan devlet üniversitesidir. Gümüşhane Üniversitesi bünyesinde 3 Enstitü, 6 Fakülte, 2 Yüksekokul, 8 Meslek Yüksekokulu ve 5 Araştırma ve Uygulama Merkezi bulunmaktadır. Bu birimlerin çatısı altında 631 akademik personel ve 310 idari personel çalışmalarını yürütmektedir. 15.500 öğrencinin öğrenim gördüğü Gümüşhane Üniversitesi gelişen ve geliştiren üniversite sloganı eğitim faaliyetlerini sürdürmektedir.', 'gumushane-universitesi', '39.5157769', '40.4364278', 'Gümüşhane', NULL, '/m/0r8npv_');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(63, 'Hacettepe Üniversitesi', 'Hacettepe Üniversitesi Rektörlüğü, Sıhhiye / ANKARA', 'http://logovector.org/wp-content/uploads/logos/png/h/hacettepe_universitesi_logo.png', 'http://hacettepe.edu.tr', 'Hacettepe Üniversitesi ilham verici bir dünya markası olan; öğrencisi, personeli ve mezunu olmaktan gurur duyulan; değişime ve gelişime liderlik eden bir üniversite olma vizyonu ile 8 Temmuz 1967’de ile tıp, sağlık bilimleri, fen ve sosyal bilimler fakülteleri ile hizmet vermeye başlamıştır. 14 fakülte, 14 enstitü, 1 yüksekokul, 3 meslek yüksekokulu, 1 konservatuvar, Teknokent ve Teknoloji Transfer Merkezi, 85 uygulama ve araştırma merkezi, öğrenci kulüpleri, spor ve kültür tesisleri, öğrenci kasabası, yurtlar, laboratuvarlar, kütüphaneler, bilgi-iletişim altyapısı, sanat müzesi, kongre merkezleri ile merkez yerleşkesinin Sıhhıye olduğu dört yerleşkeye ( Beytepe, Beşevler, Polatlı ) sahiptir. Bilim, teknoloji, görsel ve işitsel sanat alanlarında yürüttüğü araştırmalar ve verdiği eğitim-öğretimle, değişime ve gelişime açık bireyler yetiştirmeyi, her alandaki birikimini toplum yararına sunmayı görev edinen Hacettepe bünyesinde 3495 akademik personel görev yapmakta, 36112 öğrenci de öğrenim görmektedir.', 'hacettepe-universitesi', '32.7319499', '39.8692017', 'Ankara', NULL, '/m/047s3b');
