	(67, 'Hitit Üniversitesi', 'Hitit Üniversitesi, Kuzey Kampüsü, Çevre Yolu Bulvarı 19030 Çorum / TÜRKİYE', NULL, 'http://www.hitit.edu.tr/', 'Hitit Üniversitesi, 17 Mart 2006 tarihinde Çorum\'da demokratik şeffaf, özgürlükçü, ehliyet ve liyakata dayalı bir yönetim anlayışıyla ülkemiz ve dünya üniversiteleri arasında daha saygın bir yere getirmek; üretken girişimci, öncü, alanında söz sahibi mezunlar yetiştirerek, bölgemize, ülkemize ve insanlığa büyük katkılar sağlayan, tercih edilebilirliği ve bilimsel kalitesi sürekli artan bir üniversite olma amacıyla kurulmuş devlet üniversitesidir. Hitit Üniversitesi\'nin merkez yerleşkesi Kuzey Kampüsü\'ndedir. 12856 öğrencinin öğrenim gördüğü 8 fakülte, 2 yüksekokul, 3 enstitü 7 meslek yüksekokulu ve 11 araştırma ve uygulama merkezinde 574 akademik personel, 332 idari personel ve 11 Geçici personel olmak üzere toplam 917 personel ile hizmet vermektedir.', 'hitit-universitesi', NULL, NULL, 'Çorum', NULL, '/m/0cpbls6');
