INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(70, 'İnönü Üniversitesi', 'İnönü Üniversitesi Merkez Kampüsü Malatya, Türkiye', NULL, 'http://www.inonu.edu.tr/', 'İnönü Üniversitesi 1975 yılında Malatya\'da sağlık hizmetleri başta olmak üzere; eğitim, bilimsel araştırma ve sanat alanlarında uluslararası düzeyde saygın bir üniversite olma vizyonuyla kurulan devlet üniversitesidir. İnönü Üniversitesi 7000 dekarlık merkez kampüsünün yanında, 620 dönümlük Battalgazi Kampüsünde ve 2’si şehir merkezinde 4’ü ilçelerde olmak üzere toplam 6 yerleşkesinde eğitim-öğretim, bilimsel araştırma ve uygulama faaliyetlerini sürdürmektedir. 38.000 öğrencinin öğrenim gördüğü üniversitenin 13 fakülte 1’i devlet konservatuvarı olmak üzere 5 yüksekokul, 12 meslek yüksekokulu, 5 enstitü, 1 teknokent, 26 araştırma ve uygulama merkezinde yaklaşık 1.600 akademik personel görev almaktadır.', 'inonu-universitesi', '38.4352081', '38.3380823', 'Malatya', NULL, '/m/0d5b41');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(71, 'İskenderun Teknik Üniversitesi', 'İskenderun Teknik Üniversitesi, Merkez Kampüs, 31200, İskenderun/Hatay', NULL, 'http://www.istek.edu.tr/', 'İskenderun Teknik Üniversitesi, 31.3.2015 tarihinde Hatay\'ın İskenderun ilçesinde devlet statüsünde kurulmuş teknik üniversitedir. İskenderun Teknik Üniversitesini oluşturan fakültelerin çoğu Mustafa Kemal Üniversitesi\'nden ayrılarak yeni üniversiteye bağlanmıştır. 13.000 öğrencinin öğrenim gördüğü 8 fakülte, 6 enstitü, 3 yüksekokul, 1 konservatuvar ve 5 meslek yüksekokuluna 1350 akademik personel kadrosu tahsis edilmiştir.', 'iskenderun-teknik-universitesi', NULL, NULL, 'Hatay', NULL, '/g/11b7_m4m15');
