INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(73, 'İstanbul Teknik Üniversitesi', 'İTÜ Ayazağa Kampüsü, Rektörlük Binası, 34469 Maslak-İSTANBUL', NULL, 'http://www.itu.edu.tr', 'İstanbul Teknik Üniversitesi (İTÜ), 1773 yılında Mühendishane-i Bahrî-i Hümâyûn adıyla İstanbul\'da kurulmuş devlet üniversitesidir. İTÜ\'de Ayazağa, Gümüşsuyu, Maçka, Taşkışla ve Tuzla olmak üzere 5 kampüste, bilim, teknoloji ve sanatta, uzmanlığı ile uluslararası, lider bir üniversite olma vizyonuyla 13 fakültede 39 lisans programı ve 6 enstitüde yüksek lisans ve doktora programlarında eğitim verilmektedir. 2.093 akademik personelin görev yaptığı üniversitede 360 laboratuvar ve 13 araştırma merkezi bulunmaktadır. 23 akredite mühendislik programı ile dünyanın en fazla ABET Akreditasyonuna sahip üniversitesi olan İTÜ\'de 32.307 öğrenim görmektedir.', 'istanbul-teknik-universitesi', '28.9902327', '41.041398', 'İstanbul', NULL, '/m/037m4f');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(74, 'İstanbul Üniversitesi', 'İstanbul Üniversitesi Merkez Kampüsü, 34452 Beyazıt/Fatih-İstanbul', NULL, 'http://www.istanbul.edu.tr', '18 Kasım 1933\'te Doğu ile Batıyı, geçmişle geleceği buluşturan, ülkemize ve insanlığa yararlı bilgi üreten ve yetkin bireyler yetiştiren öncü üniversite olma misyonuyla kurulan İstanbul Üniversitesi\'nin kökleri 30 Mayıs 1453\'e kadar uzanmaktadır. İstanbul Üniversitesi, Beyazıt Merkez, Laleli-Vezneciler, Vefa, Horhor, Avcılar, Çapa, Cerrahpaşa, Şişli, Kadıköy, Bahçeköy, Bakırköy ve Büyükçekmece olmak üzere 12 farklı yerleşkede faaliyetlerini sürdürmektedir. 178.901 öğrencinin öğrenim gördüğü 20 fakülte 8 yüksekokul, 17 enstitü, 61 uygulama ve araştırma merkezi ve devlet konservatuvarında, 5100 akademik, 7000 idari personel görev yapmaktadır.', 'istanbul-universitesi', '28.9642283', '41.0108739', 'İstanbul', NULL, '/m/033tgd');
