INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(76, 'İzmir Katip Çelebi Üniversitesi', 'İzmir Kâtip Çelebi Üniversitesi Balatçık Kampüsü, 35620 Çiğli İzmir', NULL, 'http://www.ikc.edu.tr/', 'Kâtip Çelebi Üniversitesi, 2010 yılında  bilgiyi üreten, kullanan ve paylaşan öncü bir üniversite olma amacıyla kurulan İzmir\'in 4. devlet üniversitesidir. Üniversite, Çiğli\'de bulunan Balatçık Kampüsü\'nde konumlanmıştır. Üçüncü kuşak ya da “Dünya Üniversitesi” konsepti ile "Farklı Düşüncelerin Sesi" sloganıyla eğitim veren 4636 öğrencinin öğrenim gördüğü üniversite bünyesinde 12 fakülte, 3 enstitü ve 3 yüksekokulu bulunmakta, Bu birimlerde ise  695 akademik personel akademik çalışmalarını yürütmektedir.', 'izmir-katip-celebi-universitesi', NULL, NULL, 'İzmir', NULL, '/m/0wk9cl3');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(77, 'İzmir Yüksek Teknoloji Enstitüsü', 'İzmir Yüksek Teknoloji Enstitüsü, Urla, İzmir 35430 Türkiye', NULL, 'http://www.iyte.edu.tr/', 'İzmir Yüksek Teknoloji Enstitüsü 11 Temmuz 1992 tarihinde özellikle teknolojik alanda üst düzeyde eğitim, öğretim ve araştırma yapma temel amacı ile Türkiye\'nin teknoloji üssü sloganıyla kurulmuş bir devlet üniversitesidir. İYTE\'nin yerleşkesi İzmir\'in Urla ilçesinde konumlanmıştır. 4073 öğrencinin öğrenim gördüğü 3 fakülte, 1 enstitü, 1 yüksekokul ve 5 araştırma merkezinde 534 akademik personel ile 384 idari personel görev almaktadır.', 'izmir-yuksek-teknoloji-enstitusu', '26.642493', '38.3191', 'İzmir', NULL, '/m/02rgn1y');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(78, 'Kafkas Üniversitesi', 'Kafkas Üniversitesi Rektörlüğü, Merkez, 36000 Kars, TÜRKİYE', NULL, 'http://www.kafkas.edu.tr', 'Kafkas Üniversitesi 11 Temmuz 1992 tarihinde Dünya\'ya açılan bilim kapısı sloganı ile Kars il sınırları içerisinde kurulmuş bir devlet üniversitesidir. Kafkasya Üniversiteler Birliği\'nin kurucu üyelerinden olan Kafkas Üniversitesi, 8 ayrı yerleşkede, 10 fakülte, 3 yüksekokul, 6 meslek yüksekokulu, 1 devlet konservatuvarı, 3 enstitü, 17 araştırma merkezi olmak üzere toplam 40 akademik birime, 854 öğretim elemanına ve yaklaşık 17.000 öğrenci kapasitesine sahiptir.', 'kafkas-universitesi', NULL, NULL, 'Kars', NULL, '/m/0g9sp50');
