	(83, 'Karamanoğlu Mehmetbey Üniversitesi', 'Karamanoğlu Mehmetbey Üniversitesi, Yunus Emre Yerleşkesi, 70100 KARAMAN / TÜRKİYE ', NULL, 'http://www.kmu.edu.tr', 'Karamanoğlu Mehmetbey Üniversitesi, 28 Mayıs 2007 tarihinde bilgi çağının gerektirdiği nitelikleri taşıyan, insanlık onurunu her şeyin üstünde tutan, hayalleri ve idealleri olan bireyler yetiştiren ve gıda sektörünün iyileştirilmesi ile Türk dilinin araştırılması, yaygınlaştırılması, Türkçe bilincinin yerleştirilmesi konularında öncü çalışmalar yapan “sıradan değil, aranan” bir üniversite olma vizyonuyla Karaman\'da devlet üniversitesi statüsünde kurulmuştur. Ünivesitenin ana yerleşkesi Yunus Emre yerleşkesidir. Bunun dışında Üniversite Ermenek ve Kazım Karabekir Yerleşkeleri\'nde de konumlanmıştır. 11150 öğrencinin öğrenim gördüğü 6 fakülte, 2 yüksekokul, 2 enstitü, 5 meslek yüksekokulu ve 6 araştırma ve uygulama merkezinde 2014 yılı verilerine göre 466 akademik personel görev almaktadır.', 'karamanoglu-mehmetbey-universitesi', NULL, NULL, 'Karaman', NULL, '/m/0gjbfkd');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(84, 'Kastamonu Üniversitesi', 'Cumhuriyet Meydanı., 37150 Kastamonu, TÜRKİYE', NULL, 'http://www.kastamonu.edu.tr/', 'Kastamonu Üniversitesi 01 Mart 2006 tarihinde sunduğu bilimsel bilgi ve sağladığı özgür eğitim ortamıyla ulusal ve uluslararası seviyede tercih edilen bir ‘dünya üniversitesi’ olarak ön sıralarda yer alma amacıyla Kastamonu\'da devlet üniversitesi statüsünde kurulmuştur. Üniversitenin ana kampüsü, Daday Yolu 3. km\'de, 237 hektarlık alanda kurulu “Kuzeykent Kampüsü\'dür. Bunun dışında üniversite çevre ilçelerde meslek yüksekokulları ile konumlanmıştır. 22777 öğrencinin öğrenim gördüğü üniversitenin 11 fakülte, 2 enstitü, 4 yüksekokul, 11 meslek yüksekokulu ve 18 araştırma ve uygulama merkezinde, 654 akademik personel görev almaktadır.', 'kastamonu-universitesi', NULL, NULL, 'Kastamonu', NULL, '/m/0bbvf48');
