	(86, 'Kocaeli Üniversitesi', 'Kocaeli Üniversitesi, Umuttepe Yerleşkesi 41380, İzmit/KOCAELİ', NULL, 'http://www.kocaeli.edu.tr/', '1976 yılında "Kocaeli Devlet Mühendislik ve Mimarlık Akademisi" adı altında Elektrik, Makine, Temel Bilimler Fakülteleri ve Yabancı Diller Enstitüsü olarak kurulan Kocaeli Üniversitesi 3 Temmuz 1992 tarihinde Kocaeli Üniversitesi olarak "Bilgi Aktaran Üniversiteden, Bilgi Üreten Üniversiteye..." sloganıyla devlet üniversitesi statüsünde Türkiye\'nin sanayi kenti Kocaeli\'de eğitim hayatına başlamıştır. Yakında arkeolojik çalışmaların yürütüleceği 800 dönümü sit alanı içerisinde bulunan 6500 dönümlük Umuttepe Yerleşkesi üniversitenin ana yerleşkesidir. Bunun dışnda Üniversite Umuttepe, Yeniköy, Yahya Kaptan, Anıtpark, Arslanbey, Değirmendere, Derbent, Gölcük, Hereke, Uzunçiftlik, Kandıra, Karamürsel Köseköy, Yuvacık ve Kullar Yerleşkeleri\'nde konumlanmıştır. 72.404 öğrencinin öğrenim gördüğü 12 Fakülte, 6 Yüksekokul, 1 Devlet Konservatuarı, 3 Enstitü, 9 Araştırma ve Uygulama merkezi, 27 Araştırma ve Uygulama Birimi, 21 Meslek Yüksekokulu\'nda 2051 akademik personel (244 Profesör, 194 Doçent, 485 Yardımcı Doçent, 267 Öğretim Görevlisi, 165 okutman, 22 uzman 674 Araştırma Görevlisi) ve 1765 idari personel görev almaktadır.', 'kocaeli-universitesi', '29.9301768', '40.8216655', 'Kocaeli', NULL, '/m/026l203');
