	(89, 'Kırıkkale Üniversitesi', 'Kırıkkale Üniversitesi Ankara Yolu 7. Km 71450 Yahşihan/Kırıkkale', NULL, 'http://www.kku.edu.tr', 'Kırıkkale Üniversitesi 3 Temmuz 1992 tarihinde Kırıkkale\'de kurulmuş bir devlet üniversitesidir. Kırıkkale Üniversitesi, Kırıkkale\'de, Keskin\'de, Delice\'de ve Hacılar\'da olmak üzere dört yerleşkeye sahiptir. 27414 öğrencinin öğrenim gördüğü 12 fakülte, 3 enstitü, 1 yüksekokul, 7 meslek yüksekokulu ile 14 uygulama ve araştırma merkezinde 1149 akademik personel akademik çalışmalarını sürdürmektedir.', 'krkkale-universitesi', '33.451325', '39.871225', 'Kırıkkale', NULL, '/m/0cp3pv8');
