	(91, 'Mardin Artuklu Üniversitesi', 'Mardin Artuklu Üniversitesi, Artuklu Yerleşkesi, Diyarbakır Yolu, Artuklu / Mardin', NULL, 'http://www.artuklu.edu.tr/', 'Mardin Artuklu Üniversitesi 17 Mayıs 2007 tarihinde uluslararası düzeyde akademik yeterliliğini ispatlamış ve dikkate alınan bir sosyal bilimler üniversitesi olma vizyonuyla Mardin\'de kurulan devlet üniversitesidir Üniversitenin Mardin Şehir merkezine 5 km mesafede bulunan Mardin Artuklu Kampüsü, 7 km mesafede bulunan İstasyon Yerleşkesi ve Antik Mardin Kampüsü dışında Kızıltepe, Midyat, Nusaybin, Ömerli ilçelerinde de kampüsü bulunmaktadır. 8.000 civarı öğrencinin öğrenim gördüğü 6 Fakülte, 2 Yüksekokul, 6 Meslek Yüksekokulu, 3 Enstitü, 1 Devlet Konservatuvarı ve 4 Araştırma ve Uygulama Merkezi\'nde 438 Akademisyen ve 282 idari personel görev almaktadır.', 'mardin-artuklu-universitesi', NULL, NULL, 'Mardin', NULL, '/m/0r8nq60');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(92, 'Marmara Üniversitesi', 'Marmara Üniversitesi, Göztepe Yerleşkesi 34722, Kadıköy - İstanbul', NULL, 'http://www.marmara.edu.tr/', '16 Ocak 1883 tarihinde Hamidiye Ticaret Mekteb-i Âlisi ismi altında eğitime başlayan Marmara Üniversitesi, 1982 yılında gerçekleştirilen düzenlemelerle, eğitim, bilim, teknoloji, sanat ve sporda öncü bir üniversite olma vizyonuyla İstanbul\'da devlet üniversitesi statüsünde kurulmuştur. Marmara Üniversitesi\'nin merkez kampüsü Göztepe Kampüsü\'dür. Bunun dışında üniversite Haydarpaşa Bahçelievler, Bağlarbaşı, Kartal, Beyazıt, Anadolu Hisarı, Nişantaşı, Acıbadem, Sultanahmet, Başıbüyük Sağlık, Şişli Kampüsler\'nde konumlanmıştır.70.000 öğrencinin öğrenim gördüğü üniversitenin 16 fakülte, 11 enstitü, 5 yüksekokul, 4 meslek yüksekokulu ve 19 araştırma ve uygulama merkezinde 3.000’e yakın öğretim elemanı görev almaktadır.', 'marmara-universitesi', '29.0525022', '40.9849312', 'İstanbul', NULL, '/m/02xq7h');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
