	(94, 'Mersin Üniversitesi', 'Çiftlikköy Kampusu 33343 Yenisehir / Mersin', NULL, 'http://www.mersin.edu.tr/', 'Mersin Üniversitesi 3 Temmuz 1992\'de “Bilimin ve çağdaşlığın ışığında bir dünya üniversitesi” vizyonuyla Mersin\'de devlet üniversitesi statüsünde kurulmuştur. Üniversitenin merkez yerleşkesi Çiftlikköy yerleşkesidir. 40.587 öğrencinin öğrenim gördüğü 15 fakülte, 5 enstitü, 8 yüksekokul, 12 meslek yüksekokulu, 24 araştırma ve uygulama merkezinde 1.652 akademik personel görev almaktadır.', 'mersin-universitesi', '34.5320517', '36.7800361', 'Mersin', NULL, '/m/051wz9j');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(95, 'Mimar Sinan Güzel Sanatlar Üniversitesi', 'Kılıçali Paşa, 34433 İstanbul, Türkiye', NULL, 'http://www.msgsu.edu.tr', '1882\' de Osman Hamdi Bey tarafından kurulan Sanayi-i Nefise Mektebi, 2003 yıkında Mimar Sinan Güzel Sanatlar Üniversitesi olarak bugünkü adını almıştır. İstanbul il sınırlarından devlet üniversitesi statüsünde eğitm veren üniversite, Fındıklı, Bomonti, Dolmabahçe (Konservatuar), Balmumcu (Sinema-Tv), Salıpazarı (Geleneksel El Sanatları) yerleşkelerinde konumlanmıştır. 8952 öğrencinin öğrenim gördüğü güzel sanatlar fakültesi, mimarlık fakültesi, fen edebiyat fakültesi, devlet konservatuvarı, güzel sanatlar enstitüsü, fen bilimleri enstitüsü, sosyal bilimler enstitüsü, iki meslek yüksek okulu ve bir yüksekokulda 625 akademik personel yer almaktadır.', 'mimar-sinan-guzel-sanatlar-universitesi', '28.9890969', '41.0294464', 'İstanbul', NULL, '/m/027dr0l');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(96, 'Muğla Sıtkı Koçman Üniversitesi', 'Muğla Sıtkı Koçman Üniversitesi, 48000 Kötekli/Muğla ', NULL, 'http://www.mu.edu.tr', 'Muğla Sıtkı Koçman Üniversitesi 03 Temmuz 1992 tarihinde devlet üniversitesi statüsünde Muğla\'da uluslararası standartlarda gerçekleştirdiği eğitim-öğretim, araştırma ve uygulamalarıyla insanlığa hizmetler sunan, bu hizmetlerin toplumsal refaha dönüştürülmesine öncülük eden bir dünya üniversitesi olma vizyonuyla kurulmuştur. Üniversitede 18 fakülte, 4 enstitü, 4 yüksekokul, 13 meslek yüksekokulu, 35 uygulama ve araştırma merkezi bulunmakta; 307 bölüm/program, 77 ana bilim dalında 1.426 öğretim elemanı ve 855 idari personel ile eğitim-öğretim hizmeti verilmektedir.Üniversitede 14.206 önlisans, 19.892 lisans, 2.494 lisansüstü olmak üzere toplam 36.592 öğrenci öğrenim görmektedir. Üniversitenin kuruluşundan bu yana mezun sayısı 59.594’tür. Ayrıca 2014-2015 Eğitim-Öğretim yılı itibari ile 49 farklı ülkeden toplam 522 uluslararası öğrenci öğrenim görmektedir. Üniversite öğrencilerinin barınma ihtiyaçlarına yönelik taleplerine, merkezde 2.152 yatak kapasiteli Yurt‐Kur Milli Piyango Kız Öğrenci Yurdu ile 1.800 yatak kapasiteli Yurt – Kur Muğla Erkek Öğrenci Yurdu; ilçelerde 324 yatak kapasiteli Ortaca Öğrenci Yurdu ve 300 yatak kapasiteli Fethiye Sıtkı Mefharet Koçman Öğrenci Yurdu ile cevap verilmektedir. Aynı zamanda üniversite kampüs alanında yer alan 1.250 kişi kapasiteli Residorm öğrenci yurdu Yap‐ İşlet‐Devret modeliyle tesis edilmiş olup hizmet vermektedir.', 'mugla-stk-kocman-universitesi', '28.373845', '37.164345', 'Muğla', NULL, '/m/0266dhp');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(97, 'Muş Alparslan Üniversitesi', 'Muş Alparslan Üniversitesi Kampusu, Rektörlük, Diyarbakır Yolu 7. km 49250- MUŞ', NULL, 'http://www.alparslan.edu.tr/', 'Muş Alparslan Üniversitesi 29 Mayıs 2007 tarihinde yüksek kalitede eğitim-öğretim ve bilimsel araştırma olanakları sunma ve yaşanılan topluma açık olma ilkesiyle; teknolojiyi kullanan, bilimsel düşünen, araştıran, sorgulayan, toplum sorunlarına duyarlı, üreten, ülkemiz değerlerine ve insana saygılı, ülke kalkınmasına hizmet edebilecek mesleki bilgi ve becerilere sahip etkin bireyler yetiştirmeyi misyon edinerek Muş il sınırları içerisinde devlet üniversitesi statüsüyle kurulmuştur. Üniversite Diyarbakır yolu 7.km\'de bulunan merkez yerleşkesinde konumlanmıştır. Bunun dışında üniversitenin Malazgirt ve Karaköprü\'de de yerleşkeleri bulunmaktadır. 5700 lisans 3245 ön lisans ve 200 doktora öğrencisinin öğrenim gördüğü üniversitenin 6 fakülte 2 enstitü, 1 yüksekokul, 3 meslek yüksekokulu\'nda 464 akademik personel görev almaktadır.', 'mus-alparslan-universitesi', '41.4233923', '38.7719525', 'Muş', NULL, NULL);
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(98, 'Mustafa Kemal Üniversitesi', 'Tayfur Sökmen Kampüsü (31001) Alahan-Antakya/HATAY', NULL, 'http://www.mku.edu.tr', 'Mustafa Kemal Üniversitesi, 10.11.1992 tarihinde Hatay il sınırları içerisinde devlet üniversitesi statüsünde kurulmuştur.Tayfur Sökmen Kampüsü\'nün merkez kampüs olduğu üniversitenin ek olarak, Altınözü MYO, Antakya MYO, Araştırma ve Uygulama Hastanesi, Hatay Sağlık YO, Kırıkhan MYO, Reyhanlı MYO, Sanat Tasarım MYO Turizm ve Otelcilik MYO,Yayladağı MYO kampüsleri bulunmaktadır. 32.554 öğrencinin öğrenim gördüğü üniversitenin 3 enstitü, 14 fakülte, 6 yüksekokul, 18 meslek yüksekokulu, 1 devlet konservatuvarı, 1 araştırma uygulama hastanesi ve 20 araştırma uygulama merkezinde 1115 akademik personel ve 721 idari personel görev almaktadır.', 'mustafa-kemal-universitesi', NULL, NULL, 'Hatay', NULL, '/m/0gj9v4f');
