INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(100, 'Namık Kemal Üniversitesi', 'Namık Kemal Mahallesi Kampüs Caddesi Merkez/Tekirdağ', NULL, 'http://www.nku.edu.tr', 'Namık Kemal Üniversitesi 17 Mart 2006 tarihinde uluslararası standartlarda eğitim-öğretim hizmeti vererek, araştırmacı ve yenilikçi anlayışıyla sürekli gelişen bir dünya üniversitesi olma vizyonuyla Tekirdağ\'da devlet üniversitesi statüsünde kurulmuştur. Üniversitenin merkez kampüsü Değirmenaltı kampüsüdür. 26.500 öğrencinin öğrenim gördüğü 8 Fakülte, 1 Konservatuvar, 3 Enstitü, 3 Yüksekokul, 11 Meslek Yüksekokulu, 10 Uygulama ve Araştırma Merkezi ve 5 Bölüm Başkanlığı\'nda 1.324 akademik ve idari personel bulunmaktadır.', 'namk-kemal-universitesi', '27.5820928', '40.9927858', 'Tekirdağ', NULL, '/m/0cpbvt1');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(101, 'Necmettin Erbakan Üniversitesi', 'Necmettin Erbakan Üniversitesi Rektörlüğü Nişantaşı Mah. Dr. Hulusi Baybal Cad. No:12 Kat:25 Posta Kodu:42060 Selçuklu / KONYA', NULL, 'http://www.konya.edu.tr', 'Necmettin Erbakan Üniversitesi 14.07.2010\'da katılımcı, farklılıklara saygılı ve özgürlükçü bir kurum kültürü içinde tüm paydaşlarımızın gereksinimlerine duyarlı olma prensibini esas alarak, araştırma ve eğitim alanındaki yenilikçi ve yol gösterici üslubu ile öncülüğe yol açan, özgün bilginin ortaya çıkarılmasını ve yayılmasını sağlayan, uluslararası bir referans noktası olma vizyonuyla Konya\'da devlet üniversitesi statüsünde kurulmuştur. 27361 öğrencinin öğrenim gördüğü 14 fakülte, 5 yüksekokul, 4 enstitü, 6 koordinatörlük ve 13 araştırma merkezinde 1.150 idari personel ve 1.459 akademik personel görev almaktadır.', 'necmettin-erbakan-universitesi', NULL, NULL, 'Konya', NULL, '/g/1hb_gpz0r');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(102, 'Nevşehir Hacı Bektaş Veli Üniversitesi', '2000 Evler, Nevşehir Fakülte Yolu, 50300 Nevşehir Merkez/Nevşehir, Türkiye', NULL, 'http://www.nevsehir.edu.tr/', 'Nevşehir Hacı Bektaş Veli Üniversitesi 2007 yılında Dünyanın kültürel ve doğal miraslarından biri olan Kapadokya Bölgesinde eğitim, araştırma ve entelektüel liderliğiyle turizm, ekonomi, sanat ve teknoloji alanlarında topluma hizmet sunarak yerelden kopmadan evrensel değerlere katkıda bulunan öncü bir üniversite olma vizyonuyla devlet üniversitesi statüsünde Nevşehir\'de kurulmuştur. Üniversitenin merkez yerleşkesi Nevşehir\'de bulunmaktadır. Bunun dışında üniversite Avanos, Derinkuyu, Gülşehir, Hacıbektaş, Kozaklı, Ürgüp ilçelerinde bulunan yerleşkelerinde de eğitim vermektedir. 14609 öğrencinin öğrenim gördüğü üniversite bünyesinde bulunan 7 fakülte, 2 yüksekokul, 6 meslek yüksekokulu ve 7 araştırma merkezinde 575 akademik personel çalışmalarını yürütmektedir.', 'nevsehir-hac-bektas-veli-universitesi', NULL, NULL, 'Nevşehir', NULL, '/m/0j7m692');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(103, 'Niğde Üniversitesi', 'Niğde Üniversitesi Rektörlüğü, Merkez Yerleşke, Bor Yolu Üzeri, Niğde, 51240', NULL, 'http://www.nigde.edu.tr/', 'Niğde Üniversitesi Bilim ve teknoloji alanlarında rekabet gücüne sahip bir üniversite olma vizyonuyla Niğde\'de devlet üniversitesi olarak kurulmuştur. Merkez yerleşkesinin Bor Yolu üzerinde konumlandığı, 23.900 öğrencinin öğrenim gördüğü 9 fakülte, 3 enstitü, 3 yüksekokul, 6 meslek yüksekokulu, 1 devlet konservatuvarı, rektörlüğe bağlı 4 bölüm başkanlığı, 1 kariyer geliştirme merkezi, 9 araştırma ve uygulama merkezi ve1 sürekli eğitim merkezinde 830 akademik personel görev almaktadır.', 'nigde-universitesi', '34.623765', '37.9420419', 'Niğde', NULL, '/m/0g9wyq8');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(104, 'Ondokuz Mayıs Üniversitesi', 'Ondokuz Mayıs Üniversitesi Rektörlük Binası, Kurupelit Kampüsü, 55139 Atakum / SAMSUN', NULL, 'http://www.omu.edu.tr/', 'On Dokuz Mayıs Üniversitesi 1975 yılında Samsun\'da bilim ve teknolojide yeniliğin, eğitim ve öğretimde niteliğin, hizmette paydaş memnuniyetinin üst düzeyde olduğu, özenilen bir üniversite olma vizyonuyla devlet üniversitesi olarak kurulmuştur. Kurupelit Kampüsü\'nün merkez yerleşke olduğu üniversitenin, Güzel Sanatlar Kampüsü, M.K. G.doğdu Kampüsü, Bafra Kampüsü, Ballıca Kampüsü olmak üzere toplam 5 kampüsü bulunmaktadır. 52.300 öğrencinin öğrenim gördüğü üniversitenin 6 fakülte, 3 yüksekokul, 11 meslek yüksekokulu, 5 enstitü, 1 konservatuvar ve 23 uygulama araştırma merkezinde 2.295 akademik personel görev almaktadır.', 'ondokuz-mays-universitesi', '36.2221696', '41.3739733', 'Samsun', NULL, '/m/02vptrv');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(105, 'Ordu Üniversitesi', 'Cumhuriyet Yerleşkesi PK 52200 Merkez / ORDU', NULL, 'http://www.odu.edu.tr', 'Ordu Üniversitesi eğitim-öğretim, araştırma-geliştirme, bilimsel yayın ve uygulamada Dünya standartlarını yakalayan, ülkemizin ve bölgemizin sosyo-ekonomik, teknolojik ve kültürel gelişimine katkıda bulunacak projeler üreterek paydaşlarıyla bütünleşen yenilikçi, rekabetçi, girişimci ve tercih edilen bir üniversite olma vizyonuyla 17 Mart 2006\'da Ordu\'da devlet üniversitesi statüsünde kurulmuştur. Cumhuriyet Yerleşkesi\'nin merkez yerleşkesi olduğu üniversitenin çevre ilçelerde meslek yüksekokulu yerleşkeleri bulunmaktadır. 19000 öğrencinin öğrenim gördüğü üniversitenin 10 fakülte, 10 meslek yüksekokulu, 3 yüksekokul ve 3 enstitü 5 araştırma ve uygulama merkezinde 645 akademik, 335 de idari personel bulunmaktadır.', 'ordu-universitesi', '37.9687272', '40.9756669', 'Ordu', NULL, '/m/0h_d36h');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(106, 'Orta Doğu Teknik Üniversitesi', 'Orta Doğu Teknik Üniversitesi, Üniversiteler Mahallesi, Dumlupınar Bulvarı No:1, 06800 Çankaya Ankara/TÜRKİYE', NULL, 'http://www.odtu.edu.tr', 'Orta Doğu Teknik Üniversitesi, Türkiye ve Orta Doğu ülkelerinin kalkınmalarına katkıda bulunmak, özellikle fen bilimleri ve sosyal bilimler alanlarında eleman yetiştirmek üzere 15 Kasım 1956 tarihinde "Orta Doğu Yüksek Teknoloji Enstitüsü" adıyla devlet üniversitesi statüsünde eğitime başlamıştır. İçel-Erdemli\'de bulunan Deniz Bilimleri Enstitüsü ve Kuzey Kıbrıs Kampüsü dışında üniversitenin bütün fakülteleri ve bölümleri, Ankara\'da bulunan merkez yerleşkede bulunmaktadır. 28.000\'den fazla öğrencinin öğrenim gördüğü 3\'ü uluslararası ortak program olmak üzere 43 lisans programının yürütüldüğü 5 Fakülte, 107 yüksek lisans ve 69 doktora programının yürütüldüğü 5 Enstitü, İngilizce eğitimi veren Yabancı Diller Yüksek Okulu, ODTÜ Kuzey Kıbrıs Kampüsü\'ne bağlı 15 lisans programı ve 3 yüksek lisans programında 1.115 öğretim üyesi (Prof., Doç., Yrd.Doç.), 324 öğretim görevlisi, 1.259 araştırma görevlisi görev almaktadır.', 'orta-dogu-teknik-universitesi', '32.7842265', '39.894891', 'Ankara', NULL, '/m/02kj58');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(107, 'Osmaniye Korkut Ata Üniversitesi', 'Osmaniye Korkut Ata Üniversitesi 80000 Fakıuşağı / OSMANİYE ', NULL, 'http://www.osmaniye.edu.tr', 'Osmaniye Korkut Ata Üniversitesi 29 Mayıs 2007 tarihinde nitelikli insan kaynaklarımızla üniversite-sanayi-toplum iş birliğini sürekli hale getirerek, uluslararası düzeyde rekabet edebilen önder bir üniversite olma vizyonuyla Osmaniye\'de devlet üniversitesi statüsünde kurulmuştur. Üniversitesi Merkez Karacaoğlan Yerleşkesi’nde ve Osmaniye ilçelerinde bulunan Meslek Yüksekokullarında 5 fakülte 4 meslek yüksekokulu, 3 yüksekokul, 2 enstitüsü, 8967 öğrencisi ve 379 akademik personeli ile eğitim-öğretim faaliyetlerini sürdürmektedir.', 'osmaniye-korkut-ata-universitesi', '36.2223419', '37.0399', 'Osmaniye', NULL, '/g/120s_7jv');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(108, 'Pamukkale Üniversitesi', 'Kınıklı Kampüsü / Denizli', NULL, 'http://www.pau.edu.tr/', 'Pamukkale Üniversitesi 1992 yılında tıp, mühendislik, iktisadi bilimler, fen bilimleri, sosyal bilimler, güzel sanatlar, eğitim bilimleri ve teknik eğitim gibi birbirinden farklı alanlarda Türkiye’nin ve Dünya\'nın ihtiyaç duyduğu çağdaş, bilgili, yaratıcı, girişimci genç beyinleri yetiştirme vizyonuyla devlet üniversitesi statüsünde Denizli\'de kurulmuştur. Pamukkale Üniversitesi, bugün 14 fakülte, 5 enstitü, 4 yüksekokul ve 12 meslek yüksekokulunda Ağustos 2015 itibari ile 52148 öğrenci, 1988’i akademik olmak üzere toplam 5540 çalışanıyla Kınıklı Kampüsündeki tüm fakülte ve sosyal tesisleri ve ilçelerde bulunan mekanları ile modern eğitim-öğretim ve hizmet ortamlarını oluşturan Pamukkale Üniversitesi, uluslararası araştırma üniversitesi olma hedefine kararlı ve hızlı adımlarla ilerlemektedir.', 'pamukkale-universitesi', NULL, NULL, 'Denizli', NULL, '/m/0622h4');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(109, 'Recep Tayyip Erdoğan Üniversitesi', 'Recep Tayyip Erdogan Üniversitesi Zihni Derin Yerleşkesi - Fener Mahallesi 53100 Merkez/RİZE', NULL, 'http://www.erdogan.edu.tr', '1 Nisan 2012 tarihinde Recep Tayyip Erdoğan Üniversitesi adını alan Rize Üniversitesi olarak 7 Mart 2006 tarihinde, bilim ve teknolojik alanda rekabet gücüne sahip, evrensel düzeyde eğitim-öğretim veren, ulusal ve uluslararası düzeyde öğrenciler tarafından tercih edilen, sağlık ve mühendislik alanındaki özgün araştırmalarıyla tanınan, saygın bir üniversite olma vizyonuyla Rize\'de devlet üniversitesi statüsünde kurulmuştur. Zihni Derin Yerleşkesi\'nin merkez yerleşke olduğu, 16.140 öğrencinin öğrenim gördüğü 3 enstitü, 12 fakülte, 6 yüksekokul, 7 meslek yüksekokulu, 7 araştırma ve uygulama merkezi ve rektörlüğe bağlı 6 bölüme sahip üniversitede 925 akademik personel görev almaktadır.', 'recep-tayyip-erdogan-universitesi', '40.4944986', '41.0369382', 'Rize', NULL, '/m/0qsc9zd');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(110, 'Sakarya Üniversitesi', 'Sakarya Üniversitesi Esentepe Kampüsü 54187 Serdivan / SAKARYA', NULL, 'http://www.sau.edu.tr', 'Sakarya Üniversitesi 3 Temmuz 1992 tarihinde, ürettiği evrensel nitelikte bilgi ve teknoloji ile Türkiye ve Dünya\'da paydaşlarının geleceğine yön veren bir üniversite olma vizyonuyla Sakarya\'da kurulmuştur. Merkez yerleşkesinin Serdivan ilçesinde konumlanan Esentepe Kampüsü olduğu, 84024 öğrencinin öğrenim gördüğü 5 enstitü, 16 fakülte, 5 yüksekokul, 15 meslek yüksekokulu, 33 araştırma merkezi ve 1 teknokente sahip üniversitede 2424 öğretim elemanı görev almaktadır', 'sakarya-universitesi', '30.3405147', '40.7441916', 'Sakarya', NULL, '/m/025xyrp');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(111, 'Selçuk Üniversitesi', 'Selçuk Üniversitesi Rektörlüğü, Şemsi Tebrizi Mah. Ankara Cad. No:6 Posta Kodu:42030 Karatay-Konya', NULL, 'http://www.selcuk.edu.tr/', 'Selçuk Üniversitesi 1975 yılında Dünya çapında üniversite olmayı amaçlayan, öğrencilerin tercih ettiği ve mezunları tercih edilen, sürekli değişimi hedefleyen bir üniversite olma amacıyla Konya\'da devlet üniversitesi statüsünde kurulmuştur. Üniversitenin merkez yerleşkesi Konya\'nın Selçuklu ilçesinde bulunan Alaeddin Keykubat Kampüsü\'dür. 79.395 öğrencinin öğrenim gördüğü üniversitenin bünyesinde bulunan 23 fakülte, 6 enstitü, 5 yüksekokulda 2 bin 683 akademik personel görev almaktadır.', 'selcuk-universitesi', '32.512798', '38.0163717', 'Konya', NULL, '/m/02q0pm2');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(112, 'Siirt Üniversitesi', 'Güres Caddesi 56100 Siirt/Türkiye ', NULL, 'http://www.siirt.edu.tr/', '', 'siirt-universitesi', NULL, NULL, 'Siirt', NULL, '/m/0r8lpgb');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(113, 'Sinop Üniversitesi', 'Korucuk Köyü Trafo Mahallesi No:36 57000-SİNOP', NULL, 'http://www.sinop.edu.tr ', 'Sinop Üniversitesi 2007 yılında Bilgi toplumunun oluşmasına katkı sağlayan bir dünya üniversitesi olma vizyonuyla Sinop\'ta devlet üniversitesi statüsü ile kurulmuştur. 5677 öğrencinin öğrenim gördüğü 8 fakülte , 2 yüksekokul , 2 enstitü , 5 meslek yüksekokulu ve 10 araştırma uygulama merkezinde Sinop Üniversitesi kendi değerlerinden aldığı güç ve sürekli gelişim, yenilenme arayışı ile geleceğe odaklanmış bireyler yetiştirerek bölgesine ve ülkesine katkı sağlama misyonuyla eğitim öğretim faaliyetlerini 426 akademik personeli ile sürdürmektedir.', 'sinop-universitesi', '35.0902111', '42.0056806', 'Sinop', NULL, '/g/12168nwj');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(114, 'Şota Rustaveli Devlet Üniversitesi', '', NULL, 'http://www.bsu.edu.ge/', '', 'sota-rustaveli-devlet-universitesi', NULL, NULL, 'Batum (Gürcistan)', NULL, NULL);
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(115, 'Şırnak Üniversitesi', 'ŞIRNAK ÜNİVERSİTESİ Cumhuriyet Mahallesi Atatürk Caddesi 73000 Şırnak - Türkiye', NULL, 'http://www.sirnak.edu.tr', 'Şırnak Üniversitesi 22 Mayıs 2008 tarihinde Ulusal ve bölgesel sorunların çözümüne odaklı, yenilikçi, kalite anlayışını benimsemiş saygın bir üniversite olma vizyonuyla devlet üniversitesi statüsüyle Şırnak\'ta kurulmuştur. 3522 öğrencinin öğrenim üniversitenin bünyesinde bulunan 4 fakülte, 1 enstitü, 2 yüksekokul, 4 yüksekokulda Şırnak Üniversitesi, evrensel bakış açısıyla bilgi ve teknoloji üretmek; ürettiği bilgi ve teknolojiyi bölgenin ve ülkenin kalkınması yararına kullanmak; ulusal ve uluslararası işbirliği ve dayanışma anlayışıyla toplumun yaşam kalitesinin yükseltilmesine yönelik eğitim ve araştırma faaliyetlerine öncülük etmek; ülkenin ihtiyaç duyduğu araştırmacı, paylaşımcı, sorgulayıcı, çözümleyici, girişimci, yaşam boyu öğrenmeyi benimsemiş, kültürlü ve estetik değerlere sahip bireyler yetiştirme misyonuyla eğitim ve öğretim faaliyetlerine 272 akademik personel ile devam etmektedir.', 'srnak-universitesi', NULL, NULL, 'Şırnak', NULL, '/g/120trzgp');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(116, 'Süleyman Demirel Üniversitesi', 'Süleyman Demirel Üniversitesi, 32260 Çünür/ISPARTA', NULL, 'http://www.sdu.edu.tr/', 'Süleyman Demirel Üniversitesi 1992 yılında Isparta\'da eğitim-öğretim, bilim ve araştırmada kaliteden ödün vermeden emin adımlarla geleceğe yürüyerek, bilimsel çalışmalarıyla dünyaya şekil vererek, içinde bulunulan yörenin toplumsal değerlerine saygılı, yereli iyi bilen, ülke sorunlarına duyarlı, bölgesinde lider, bununla birlikte bir Dünya üniversitesi olarak gelişmesini sürdürme vizyonuyla kurulan bir devlet üniversitesidir. Üniversite binalarının büyük bir kısmı Isparta’daki merkez yerleşkededir. Süleyman Demirel Üniversitesi; 19 fakülte, 3 yüksekokul, 20 meslek yüksekokulu, 6 enstitü ile 46 araştırma ve uygulama merkezine ve burada öğrenim gören 55.293 öğrenciye sahip olup modern eğitim olanakları ve güçlü akademik kadrosuyla öğrencilerine kucak açan, öğrencilerinin çeşitli meslek dallarında en iyi eğitimi almalarını amaç edinmiştir.', 'suleyman-demirel-universitesi', '30.5295082', '37.8324966', 'Isparta', NULL, '/m/0f04kj');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(117, 'Sumgayıt Devlet Üniversitesi', '', NULL, 'http://sdu.edu.az/', '', 'sumgayt-devlet-universitesi', NULL, NULL, 'Sumgayıt (Azerbaycan)', NULL, '/m/0cnfvr');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(118, 'Trakya Üniversitesi', 'Trakya Üniversitesi Rektörlüğü, 22030 Balkan Yerleşkesi / EDİRNE', NULL, 'http://www.trakya.edu.tr/', 'Trakya Üniversitesi 1982 yılında bilim ve eğitim dünyasında küresel ölçekte etkin, tanınan, izlenen ve tercih edilen bir üniversite olma vizyonuyla Edirne\'de kurulan vir devlet üniversitesidir. Üniversite Balkan yerleşkesi başta olmak üzere 6 yerleşkede (Ayşekadın Yerleşkesi, Prof. Dr. Ahmet Karadeniz Yerleşkesi, Kosova Yerleşkesi, Selimiye Yerleşkesi, Sarayiçi Yerleşkesi, Makedonya Yerleşkesi ) konumlanmıştır. 39696 öğrencinin öğrenim gördüğü 12 Fakülte 5 Enstitü 6 Yüksekokul 10 Meslek Yüksekokulu 1 devlet konservatuvarında Trakya Üniversitesi 1646 akademik personeli ile araştırma, eğitim ve öğretim faaliyetini, bilimsel ve kültürel mirası değerlendirip çağın gerçeklerini görerek geleceği kurma ilkesiyle yürütmek; bilgi ve becerilerini Edirne, Balkanlar, ülke ve insanlık yararına kullanma bilincine sahip, özgüven ve sorumluluk duygusu yüksek bireyler yetiştirme misyonuyla faaliyetlerini sürdürmektedir.', 'trakya-universitesi', '26.613113', '41.637027', 'Edirne', NULL, '/m/03chg1r');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(119, 'Tunceli Üniversitesi', 'Aktuluk Kampüsü Merkez/TUNCELİ PK:62000', NULL, 'http://www.tunceli.edu.tr', 'Tunceli Üniversitesi, 22 Mayıs 2008 tarihinde Yenilikçi, dinamik ve katılımcı yapısıyla, bölgemizde eksikliği hissedilen girişimcilik ruhunu canlandırabilecek Ar-Ge faaliyetleriyle, bölgesindeki insanî ve sosyal sorunlara çözüm üreten, ülkemizin doğu ve güneydoğu komşularıyla mevcut ilişkileri geliştiren, eğitim-öğretim, araştırma ve geliştirme yapan, yerelde etkin başarıya sahip teknoloji odaklı bir dünya üniversitesi olarak ilerleme vizyonuyla Tunceli\'de kurulan bir devlet üniversitesidir. Üniversite Tunceli Merkez, Pertek, Pülümür, Hozat, Nazımiye, Mazgirt, Ovacık\'ta bullunan yerleşkelerinde konumlanmıştır. Tunceli Üniversitesi, 7063 öğrencinin öğrenim gördüğü üniversitenin 2 enstitü, 7 araştırma merkezi, 6 fakülte, 1 yüksekokul, 8 meslek yüksekokulunda 418 akademik personel Munzur’dan yükselen bilim güneşi sloganıyla eğitim öğretim faaliyetlerini sürdürmektedir.', 'tunceli-universitesi', NULL, NULL, 'Tunceli', NULL, NULL);
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(120, 'Türk-alman Üniversitesi', 'Şahinkaya Cad. 86 - 34820 Beykoz / İSTANBUL', NULL, 'http://www.tau.edu.tr/', 'Türk-Alman Üniversitesi (TAÜ), Türkiye Cumhuriyeti ile Almanya Federal Cumhuriyeti arasında imzalanan anlaşmaya dayanarak kurulan bir devlet üniversitesidir. TAÜ\'nün yerleşkesi Beykoz ilçe sınırlarında bulunmaktadır. Kendisini akademik sınıflamada bir araştırma üniversitesi olarak tanımlayan 311 öğrencinin öğrenim gördüğü üniversitenin bünyesinde 5 fakülte, 2 enstitü ve 1 yabancı diller yüksekokulu bulunmaktadır. Bu birimlerde 72 akademik personel görev almaktadır.', 'turk-alman-universitesi', NULL, NULL, 'İstanbul', NULL, '/g/1226lvhl');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(121, 'Uludağ Üniversitesi', 'Görükle Kampusu 16059 Nilüfer/BURSA', NULL, 'http://www.uludag.edu.tr/', 'Uludağ Üniversitesi 1975 yılında aklın ve bilimin öncülük ettiği, Atatürk\'ün çizdiği çağdaş, laik ve demokratik yolda, özgür düşünceli ve kişisel sorumluluk duyguları gelişmiş ulusal değerlere saygılı olarak kültürel ve tarihi değerleri benimsemiş, çağdaş görünüşlü gençler yetiştirmeyi amaç edinerek Bursa il sınırları içerisinde bir devlet üniversitesi olarak kurulmuştur. Üniversite merkez yerleşke olan Görükle, Gemlik Sunğipek-Asım Kocabıyık Yerleşkesi, Ali Osman Sönmez Kampusu, Mudanya, Mustafakemalpaşa, Karacabey, İnegöl, İznik, Yenişehir İbrahim Orhan, Orhangazi, Orhaneli, Keles, Harmancık ve Büyükorhan\'da konumlanmıştır. Üniversite bünyesinde bulunan 13 Fakülte, 3 Yüksekokul, 15 Meslek Yüksekokulu, 1 Konservatuvar, 4 Enstitü, 18 Uygulama ve Araştırma Merkezi ile 2 Araştırma Merkezi ve Rektörlüğe bağlı olarak kurulan 5 bölümde 60.000 öğrenci öğrenim görmektedir.', 'uludag-universitesi', '28.8667694', '40.2225309', 'Bursa', NULL, '/m/02z6_k6');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(122, 'Uşak Üniversitesi', 'Ankara İzmir Yolu 8.Km 1.Eylül Kampüsü, Uşak/Merkez', NULL, 'http://www.usak.edu.tr', 'Uşak Üniversitesi 17 Mart 2006 tarihinde Afyon Kocatepe Üniversitesi\'nden ayrılarak Uşak il sınırları içerisinde “Aklın ve Bilimin Işığında Saygın Bir Üniversite” sloganıyla bir devlet üniversitesi olarak kurulmuştur. 1 Eylül Kampüsü üniversitenin merkez kampüsüdür. Bunun dışında çevre ilçelerde üniversitenin meslek yüksekokulları konumlanmıştır. 22.145 öğrencinin öğrenim gördüğü üniversitenin 11 fakülte, 3 yüksekokul, 11 meslek yüksekokulu, 2 enstitü ve 21 araştırma ve uygulama merkezinde 1589 akademik personel görev almaktadır.', 'usak-universitesi', NULL, NULL, 'Uşak', NULL, '/m/0cp3pm9');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(123, 'Yalova Üniversitesi', 'Yalova Üniversitesi Merkez Yerleşkesi, Çınarcık Yolu Üzeri 77200 Yalova', NULL, 'http://www.yalova.edu.tr', 'Temelini Uludağ Üniversitesi Yalova Meslek Yüksek Okulu\'nun oluşturduğu Yalova Üniversitesi, 31 Mayıs 2008 tarihinde Dünya ile entegre olabilecek çağdaş donanımlara sahip bireyler yetiştirmeyi hedef edinerek Yalova\'da bir devlet üniversitesi olarak kurulmuştur. Çınarcık Yolu 2.Km\'de bulunan Merkez Yerleşkesi\'nde konumlanan üniversitenin çevre ilçelerde meslek yüksekokulu yerleşkeleri bulunmaktadır.11243 öğrencinin öğrenim gördüğü, üniversite bünyesinde bulunan 5 fakülte, 2 enstitü, 4 meslek yüksekokulu ve 1 yüksekokulda 497 akademik personel görev almaktadır.', 'yalova-universitesi', NULL, NULL, 'Yalova', NULL, '/m/076zj7r');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(124, 'Yıldırım Beyazıt Üniversitesi', 'Çankırı Caddesi Çiçek Sokak No:3 Ulus-ALTINDAĞ / ANKARA', NULL, 'http://www.ybu.edu.tr', 'Yıldırım Beyazıt Üniversitesi Ankara\' nın 5. devlet üniversitesi olarak 03 ekim 2011 tarihinde devlet üniversitsi olarak Üniversite eğitiminde yeni bir soluk sloganı ile eğitim hayatına başlamıştır. Merkez yerleşkesi Ulus\'ta bulunan üniversitenin Etlik,Cinnah, Bilkent, Esenboğa, Keçiören\'de yerleşkeleri bulunmaktadır. 8 fakülte, 1 yüksekokul, 4 enstitü ve 1 konservatuvar ile öğretim yapan üniversitede 1018 akademisyen görev yapmakta 11319 öğrenci de üniversitede öğrenim görmektedir.', 'yldrm-beyazt-universitesi', NULL, NULL, 'Ankara', NULL, '/m/0r8kdtz');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(125, 'Yıldız Teknik Üniversitesi', 'Barbaros Bulvarı, 34349 Yıldız-İstanbul', NULL, 'http://www.yildiz.edu.tr', 'Yıldız Teknik Üniversitesi, 1911 yılında eğitim, araştırma ve kültür ortamı ile tercih edilen bir dünya üniversitesi olma vizyonuyla İstanbul’da kurulmuş bir vakıf üniversitesidir. Üniversitenin merkez yerleşkesi, Yıldız Yerleşkesi\'dir. Bunun dışında üniversite Davutpaşa ve Ayazağa Kampüsleri\'nde de faaliyet göstermektedir. 34179 öğrencinin öğrenim gördüğü üniversitenin 10 fakülte, 2 enstitü, 2 meslek yüksekokulu ve yabancı diller yüksekokulunda 1756 öğrenci öğrenim görmektedir.', 'yldz-teknik-universitesi', '29.010297', '41.052244', 'İstanbul', NULL, '/m/09_vfv');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(126, 'Yüzüncü Yıl Üniversitesi', 'Yüzüncü Yıl Üniversitesi Rektörlüğü, 65080, Kampüs / VAN', NULL, 'http://www.yyu.edu.tr/', 'Yüzüncü Yıl Üniversitesi, 1982 yılında Van il sınırları içerisinde kurulmuş bir devlet üniversitesidir. Üniversite Van Gölü kenarında kurulmuş, şehir merkezine 15 km mesafede olan kampüsünde eğitim öğretim faaliyetlerini sürdürmektedir. 25.393 öğrencinin öğrenim gördüğü üniversitenin 14 fakülte, 4 enstitü, 11 yüksekokul ve 19 uygulama ve araştırma merkezinde 1657 akademik personel görev almaktadır.', 'yuzuncu-yl-universitesi', '43.291709', '38.5673875', 'Van', NULL, '/m/0276cz7');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(127, 'Acıbadem Üniversitesi', 'Kerem Aydınlar Kampüsü, Kayışdağı Cad. No:32, 34752​ Ataşehir/İSTANBUL', NULL, 'http://www.acibadem.edu.tr', '8 Mayıs 2007\'de kurulan Acıbadem Üniversitesi 4 fakülte, 2 enstitü, 2 meslek yüksekokulu ve 6 araştırma merkezi ile Ataşehir, İstanbul\'da 387 öğretim elemanı ile sağlık bilimleri alanında faaliyet gösteren vakıf üniversitesidir. 2009-2010 eğitim öğretim yılında da ilk öğrencilerini alarak eğitime başlayan üniversite 2010-2011 eğitim öğretim yılında ilk mezunlarını vermiştir. Acıbadem Üniversitesi\'nde 2325 öğrenci öğrenim görmektedir.', 'acbadem-universitesi', NULL, NULL, 'İstanbul', NULL, '/m/0cpdxrm');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(128, 'Akdeniz Karpaz Üniversitesi', '', NULL, 'http://www.akun.edu.tr/', '', 'akdeniz-karpaz-universitesi', NULL, NULL, 'Lefkoşa (KKTC)', NULL, '/g/1q678bmrn');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(129, 'Alanya Hamdullah Emin Paşa Üniversitesi', 'Alanya Hamdullah Emin Paşa Üniversitesi, Cikcilli Mah. Saraybeleni Cad. No:7, 07400 Alanya/Antalya/Türkiye', NULL, 'http://www.ahep.edu.tr', 'Alanya Hamdullah Emin Paşa Üniversitesi, Hamdullah Emin Paşa ve Haremi Hatice Tahire Hanım Vakfı tarafından 3 Mart 2011 tarihinde Antalya\'ya bağlı olan Alanya ilçesinde Akdeniz tarih ve kültürünün kesiştiği Alanya`da; eğitim, araştırma ve topluma hizmet sunma sorumluluğuna sahip bir üniversite olma amacıyla kurulmuş bir vakıf üniversitesidir. Üniversite Nimet ve Abdurrahman Alaettinoğlu yerleşkelerinde konumlanmıştır. Tüm lisans programlarının %100 İngilizce olduğu üniversite bünyesinde 2 fakülte ve 1 yüksekokul bulunmaktadır.', 'alanya-hamdullah-emin-pasa-universitesi', NULL, NULL, 'Antalya', NULL, '/g/15dpmx5b');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(130, 'Atılım Üniversitesi', 'Kızılcaşar Mahallesi, 06836 İncek Gölbaşı - Ankara - Türkiye', NULL, 'http://www.atilim.edu.tr', 'Atılım Üniversitesi, özgün bilimsel çalışmalarda adı olan, nitelikli ve yetkin bireyler yetiştiren, geleceğe iz bırakan bir üniversite olma vizyonu ile 15 Temmuz 1997 tarihinde Ankara\'da Atılım Vakfı tarafından bir vakıf üniversitesi olarak kurulmuştur. İncek Gölbaşı\'nda bulunan yerleşkesi Ankara merkeze 20 km uzaklıktadır. Bünyesinde bulunan 5 fakülte, 2 enstitü, 1 yüksekokul, 1 meslek yüksekokulu, 9 araştırma merkezi ve 601 akademik personeli, üniversitede öğrenim gören 8188 öğrencisine, toplumsal duyarlılık anlayışı içinde, bilimsel bilginin üretimi ve uygulanmasında performansı yüksek alanlar yaratarak, ulusal ve evrensel düzeyde donanıma sahip nitelikli bireyler yetiştirme misyonu ile eğitim öğretim vermektedir.', 'atlm-universitesi', '32.7233147', '39.8153966', 'İstanbul', NULL, '/m/065h3w');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(131, 'Avrasya Üniversitesi', 'T.C. Avrasya Üniversitesi Rektörlüğü Adnan Kahveci Mahallesi Rize caddesi, No:226 TRABZON / TURKEY', NULL, 'http://www.avrasya.edu.tr', '', 'avrasya-universitesi', '39.8058634', '40.987894', 'Trabzon', NULL, '/m/012fy49p');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(132, 'Bahçeşehir Üniversitesi', '', NULL, 'http://www.bahcesehir.edu.tr', 'Bahçeşehir Üniversitesi, 1998 yılında Bahçeşehir-Uğur Eğitim Vakfı tarafından “İstanbul\'un Kalbinde Bir Dünya Üniversitesi” sloganıyla açılan bir vakıf üniversitesidir. Merkez kampüsünün Beşiktaş\'ta olduğu Bahçeşehir Üniversitesi\'nin İstanbul\'daki diğer kampüsleri Galata, Göztepe ve Şişli\'de bulunmaktadır. Bunun dışında Bahçeşehir Üniversitesi\'nin yurt dışında Berlin,Silikon Vadisi, Hong Kong, Köln, Batum ve Toronto’da olmak üzere toplam 6 kampüsü daha bulunmaktadır. 8 fakülte, 1 yüksekokul, 2 meslek yüksekokulu ve 14 araştırma merkezinin faaliyet gösterdiği Bahçeşehir Üniversitesi\'nde 1047 akademik personel, 506 idari personel görev almakta ve 17.048 öğrenci öğrenim görmektedir.', 'bahcesehir-universitesi', NULL, NULL, 'İstanbul', NULL, '/m/0bq1kt');
