	(133, 'Başkent Üniversitesi', 'Bağlıca Kampüsü Eskişehir Yolu 20. km Bağlıca, 06810 ANKARA', NULL, 'http://www.baskent.edu.tr', '', 'baskent-universitesi', NULL, NULL, 'Ankara', NULL, '/m/02r7mgx');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(134, 'Beykent Üniversitesi', 'Taksim Yerleşkesi, Sıraselviler, 34433 Beyoğlu/İstanbul, Türkiye', NULL, 'http://www.beykent.edu.tr', 'Beykent Üniversitesi, 1997 yılında İstanbul\'da profesyonel yaşam için doğru seçim sloganıyla kurulmuş bir vakıf üniversitesidir. Ayazağa-Maslak, Beylikdüzü ve Taksim olmak üzere üç yerleşkede eğitim faaliyetlerini sürdüren üniversitenin bünyesinde 9 fakülte, 1 meslek yüksekokulu ve 2 enstitü bulunmaktadır. 500 öğretim üyesinin görev yaptığı bu birimlerde 25.000 öğrenci öğrenim görmektedir.', 'beykent-universitesi', '29.0040176', '41.1172697', 'İstanbul', NULL, '/m/03cc49z');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(135, 'Bezm-i Âlem Vakıf Üniversitesi', 'Adnan Menderes Bulvarı Vatan Caddesi 34093 Fatih/İstanbul', NULL, 'http://www.bezmialem.edu.tr', 'Bezmi Alem Vakıf Üniversitesi, Bezm-i Alem Valide Sultan Vakıf Gureba tarafından 2010\'da vakıf üniversitesi statüsünde kurulmuştur. Sağlık bilimleri üzerine eğitim veren üniversitenin merkez yerleşkesi İstanbul\'un Fatih ilçesindedir. Yine aynı şehirde üniversitenin Gayrettepe kampüsü bulunmaktadır. Eğitimde örnek alınan, bilime yön veren, lider sağlık üniversitesi olma vizyonuyla hareket eden üniversite bünyesinde 4 fakülte, 1 meslek yüksekokulu, 4 enstitü, 2 kurul ve 2 araştırma merkezi bulunmaktadır. 2067 öğrencinin öğrenim gördüğü üniversitede 483 akademik personel çalışmalarını sürdürmektedir.', 'bezm-i-alem-vakf-universitesi', NULL, NULL, 'İstanbul', NULL, NULL);
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(136, 'Biruni Üniversitesi', '10. Yıl Caddesi Protokol Yolu No: 45, 34010 Topkapı İstanbul', NULL, 'http://www.biruni.edu.tr/', 'Biruni Üniversitesi 27.02.2014 tarihinde İstanbul\'da kurulmuş bir vakıf üniversitesidir. Topkapı\'da bulunan kampüsünde kurulduğu günden bugüne eğitim, araştırma ve hizmetleri ile ülkemiz ve Dünya’da referans kabul edilen yenilikçi, girişimci lider bir sağlık üniversitesi olma vizyonuyla çalışmalarını sürdürmektedir. Bünyesinde bulunan 6 fakülte 3 enstitü, 1 meslek yüksek okulu ve 1 araştırma merkezinde sağlığın her alanında bilgi üreten ve uygulama sorumluluğu taşıyan, öğrenci odaklı, toplumun değer yargılarına ve farklılıklarına saygılı, dünya standartlarında eğitim ve hizmet verme misyonuyla 4 binden fazla öğrenciye eğitim-öğretim vermektedir.', 'biruni-universitesi', NULL, NULL, 'İstanbul', NULL, '/g/1q5jpwm52');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(137, 'Çağ Üniversitesi', 'Adana-Mersin Karayolu Üzeri 33800 YENİCE- TARSUS / MERSİN', NULL, 'http://www.cag.edu.tr/', '', 'cag-universitesi', NULL, NULL, 'Mersin', NULL, '/m/0gywqg8');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(138, 'Çankaya Üniversitesi', 'Eskişehir Yolu 29. Km, Yukarıyurtçu Mahallesi Mimar Sinan Caddesi No:4 06790, Etimesgut/ANKARA', NULL, 'http://www.cankaya.edu.tr/', 'Çankaya Üniversitesi, Sıtkı Alp Eğitim Vakfı tarafından Dünya standartlarında kaliteli yükseköğretim ve uluslararası yabancı dilde eğitim sağlayan; uluslararası düzeyde araştırma-geliştirme çalışmaları yapan ve bilgi üreten; topluma hizmeti temel görevleri arasında sayan; bilgi toplumunun oluşmasında türkiyemizde öncülük eden; Türkiye Cumhuriyeti’nin demokratik, laik ve sosyal hukuk devleti niteliklerine sahip çıkan; vatanını, milletini ve tüm insanları seven bireyler yetiştiren; üniversite-sanayi işbirliğine önem veren; toplumun her kesiminde saygı duyulan, bir üniversite olmak amacıyla 1997-1998 öğretim yılında Ankara\'da faaliyete geçmiştir.Biri Ankara Balgat\'ta diğeri Eskişehir yolu üzerinde iki kampüsü bulunan üniversitenin 5 fakülte, 21 bölüm, 2 meslek yüksekokulu ve 2 enstitüsü bulunmaktadır. 286 akademisyenin çalışmalarını yürüttüğü bu birimlerde 7068 öğrenci öğrenim görmektedir.', 'cankaya-universitesi', '32.5643239', '39.8192699', 'Ankara', NULL, '/m/08ngh6');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(139, 'Doğuş Üniversitesi', 'Acıbadem, Kadıköy, 34722 İstanbul', NULL, 'http://www.dogus.edu.tr', 'Doğuş Üniversitesi, Doğuş Eğitim Vakfı tarafından 1997 yılında İstanbul\'da eğitim-öğretimde, araştırmada ve topluma hizmette mükemmele ulaşmış bir dünya üniversitesi olma amacıyla kurulmuş bir vakıf üniversitesidir. Kadıköy’de Acıbadem Mahallesi’nde bulunan yerleşkesinde ülkemizin bilim, teknoloji, sanat ve kültür alanındaki gelişmelerinde öncü rol üstlenme ve bu alanlarda insanlığın yararına çalışmalar yürütme misyonuyla eğitim veren Doğuş Üniversitesi bünyesinde 5 fakülte, 2 enstitü, 1 meslek yüksekokulu ve 1 sürekli eğitim merkezi bulunmaktadır. Bu birimlerde 182 akademisyen görev almakta, 5518 öğrenci de öğrenim görmektedir.', 'dogus-universitesi', '29.0471269', '41.0004024', 'İstanbul', NULL, '/m/02qgp_m');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(140, 'Fatih Sultan Mehmet Vakıf Üniversitesi', 'Zeyrek Mah. Büyükkaraman Cad. No:53 Fatih /İSTANBUL', NULL, 'http://www.fsm.edu.tr', 'Fatih Sultan Mehmet Üniversitesi Vakıf Üniversitesi, Fatih Sultan Mehmet Han Vakfı, Sinan Ağa bin Abdurrahman , Nurbanu Valide Sultan , Hatice Sultan ve Abdullahoğlu Hacı Abdülaziz Ağa Vakıflarının ortak çalışmasıyla 2010 yılında tarihin derinliklerinden bilimin ve sanatın ufuklarına sloganıyla İstanbul\'da vakıf üniversitesi statüsü ile kurulmuştur. Üniversite, rektörlüğün bulunduğu Fatih yerleşkesi ile birlikte Haliç, Topkapı, Kandilli, Küçük Çamlıca, Atik Valide Yerleşkelerinde konumlanan üniversite bünyesinde 6 fakülte, 5 enstitü ve 2 meslek yüksek okulu bulunmaktadır. Bu birimlerde 213 akademik personel çalışma yürütmektedir. 3815 öğrenci ise üniversitede öğrenim görmektedir.', 'fatih-sultan-mehmet-vakf-universitesi', NULL, NULL, 'İstanbul', NULL, '/g/113qbrdxg');
