INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(144, 'Haliç Üniversitesi', 'Merkez Mah. Cendere Cad. No:5 Kağıthane - İSTANBUL', NULL, 'http://www.halic.edu.tr', 'T.C. Haliç Üniversitesi, Bizim Lösemili Çocuklar Vakfı tarafından 15.01.1998 tarihinde her alanda önemli gelişmeler kaydeden yeni Türkiye’nin hedeflerine katkı sağlayan, çoğulcu, özgürlükçü, katılımcı ve demokratik bir üniversite olma vizyonuyla kurulan bir vakıf üniversitesidir. Kağıthane Yerleşkesi üniversitenin merkez yerleşkesidir. Haliç Üniversitesi\'nin bunun dışında Şişhane, Bomonti, Levent ve Sütlüce yerleşkeleri bulunmaktadır. Üniversite 5 Fakülte, 3 Yüksekokul, 1 Konservatuvar, 1 Meslek Yüksekokulu ve 3 Enstitüsünde ön lisans, lisans, yüksek lisans ve doktora/sanatta yeterlik programları da dahil olmak üzere yaklaşık 10.000 öğrencisi ve 339 akademik personeli ile eğitim-öğretim faaliyetine devam etmektedir.', 'halic-universitesi', NULL, NULL, 'İstanbul', NULL, '/m/0g53jr4');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(145, 'Hasan Kalyoncu Üniversitesi', 'Hasan Kalyoncu Üniversitesi Havaalanı Yolu Üzeri 8. km. - Şahinbey / GAZİANTEP', NULL, 'http://www.hku.edu.tr', 'Hasan Kalyoncu Üniversitesi Gaziantep Eğitim ve Hizmet Vakfı tarafından 30 Temmuz 2008 tarihinde Gaziantep\'te vakıf üniversitesi olarak eğitimin hayat boyu seninle sloganı ile kurulmuştur. Üniversite\'nin 5 fakülte, 2 yüksekokul 1 meslek yüksekokulu, 3 enstitü ve 9 araştırma ve uygulama merkezinde 203 akademisyen çalışmalarını yürütmektedir. 4332 öğrenci ise bu birimlerde öğrenim görmektedir.', 'hasan-kalyoncu-universitesi', NULL, NULL, 'Gaziantep', NULL, NULL);
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(146, 'İhsan Doğramacı Bilkent Üniversitesi', 'Bilkent Üniversitesi, 06800 Bilkent/Ankara/TÜRKİYE', NULL, 'http://www.bilkent.edu.tr/', 'İhsan Doğramacı Bilkent Üniversitesi 1984’te Türkiye’nin ilk vakıf üniversitesi olarak Ankara’da kurulmuş,1986’da tüm bilimler, teknoloji ve sanatı kapsayan bir öğrenme ve ilerleme ortamı oluşturarak, insanlığa hizmet etmek ve dünya barışını geliştirme misyonuyla eğitime başlamıştır. Bilkent Üniversitesi\'nin yerleşkesi kent merkezine 12 km. mesafede ve 5.000 dönümlük bir alan üzerinde konumlanmıştır. 13.000 öğrencinin öğrenim gördüğü 9 fakültesi ve 2 yüksekokulu bünyesindeki 29 lisans ve 51 lisansüstü programında 1000 kadar akademik personel çalışmalarını yürütmektedir.', 'ihsan-dogramac-bilkent-universitesi', '32.748825', '39.8690764', 'Ankara', NULL, '/m/034l98');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(147, 'Işık Üniversitesi', 'Işık Üniversitesi Büyükdere Caddesi No: 194 34398 Maslak/İstanbul', NULL, 'http://www.isikun.edu.tr/', 'Işık Üniversitesi 1996 yılında köklü eğitim geleneği ile toplumsal sorumluluğa sahip, geleceği aydınlatan nesilleri yetiştiren, dünya standardında bir üniversite olma vizyonu ile İstanbul il sınırları içerisinde vakıf üniversitesi statüsünde kurulmuştur. Işık Üniversitesi\'nin Maslak ve Şile olmak üzere iki yerleşkesi mevcuttur. 5554 öğrencinin öğrenim gördüğü 5 fakülte 1 yabancı diller okulu, 2 meslek yüksekokulunda 233 akademik personel görev yapmaktadır.', 'isk-universitesi', NULL, NULL, 'İstanbul', NULL, '/m/02vxsj');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(148, 'İstanbul 29 Mayıs Üniversitesi', 'İcadiye-Bağlarbaşı Caddesi, No: 40 34662 Üsküdar/İstanbul', NULL, 'http://www.29mayis.edu.tr', 'İstanbul 29 Mayıs Üniversitesi, 2010 yılında Türkiye Diyanet Vakfı tarafından özgün araştırmalarla insanlığın bilimsel birikimine katkıda bulunmayı ve bunu sağlayabilmek için yetkin araştırmacı ve bilim insanları yetiştirme amacıyla kurulmuş bir vakıf üniversitesidir. Üsküdar da merkez kampüsü bulunan üniversitenin ikinci kampüsü Ümraniye ilçe sınırları içerisindedir. 872 öğrencinin öğrenim gördüğü 3 fakülte, 1 enstitü, 1 yüksekokul ve 4 araştırma merkezinde 29 Mayıs Üniversitesi, 105 personelin bulunduğu yetkin akademik kadrosuyla faaliyetlerini sürdürmektedir.', 'istanbul-29-mays-universitesi', '29.04076', '41.0257369', 'İstanbul', NULL, '/g/120vhgl9');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(149, 'İstanbul Arel Üniversitesi', 'Türkoba Mahallesi Erguvan Sokak No:26 / K 34537, Tepekent - Büyükçekmece, İstanbul-Türkiye', NULL, 'http://www.arel.edu.tr', 'İstanbul Arel Üniversitesi, 18 Mayıs 2007 tarihinde Kemal Gözükara Eğitim ve Kültür Vakfı tarafından Atatürk İlke ve İnkılaplarına bağlı; laik, demokrat ve sosyal hukuk devleti olan Türkiye Cumhuriyeti’nin varlığına inanmış, ulusal değerlere sahip, bilimsel ve teknolojik gelişmelere açık, araştıran, küresel düşünebilen, evrensel değerlere saygılı gençler yetiştirme amacıyla vakıf üniversitesi statüsünde İstanbul\'da kurulmuştur. Arel Üniversitesi\'nin Tepekent ve Sefaköy\'de iki yerleşkesi bulunmaktadır. Üniversite bünyesinde Fen - Edebiyat, İktisadi ve İdari Bilimler, Güzel Sanatlar, Mühendislik - Mimarlık ve İletişim Fakültesi olmak üzere 5 fakülte, Uygulamalı Bilimler Yüksekokulu, Sağlık Bilimleri Yüksekokulu ve Yabancı Diller Yüksekokulu olmak üzere 3 yüksekokul, 1 meslek yüksekokulu ile Fen Bilimleri Enstitüsü ve Sosyal Bilimler Enstitüsü olmak üzere 2 enstitü bulunmakta bu birimlerde 12.600 öğrenci öğrenim görmekte, 427 akademik personel de çalışmalarını yürütmektedir.', 'istanbul-arel-universitesi', '28.5002626', '41.0555413', 'İstanbul', NULL, '/m/0r8mvy7');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(150, 'İstanbul Aydın Üniversitesi', 'Beşyol Mah.Inönü Cad.No: 38, Sefaköy-Küçükçekmece / İSTANBUL', NULL, 'http://www.aydin.edu.tr', 'İstanbul Aydın Üniversitesi, Anadolu Eğitim ve Kültür Vakfı tarafından İstanbul\'da bilgiyi üretime dönüştürerek insanlığa fayda sağlayacak bireylerin, çağdaş değişimler doğrultusunda kendini yenileyebilen eğitim programlarında yetiştirildiği, sürdürülebilir yeniliklerin hayat bulduğu öncü bir yükseköğretim kurumu olma vizyonuyla 18.05.2007 tarihinde kurulmuş vakıf üniversitesidir. Merkez yerleşkesi Florya Yerleşkesi olan üniversite, Bahçelievler, Bahçelievler Diş Hekimliği, Kadıköy, Beşiktaş ve Bakırköy olmak üzere toplam 6 yerleşkede faaliyetlerini sürdürmektedir. 21.961 öğrencinin öğrenim gördüğü, 10 fakülte, 3 enstitü, 1 yüksekokul, 3 meslek yüksekokulu, ve 19 araştırma merkezinde 727 akademik personel ile 453 idari personel görev almaktadır.', 'istanbul-aydn-universitesi', '28.7980608', '40.9917087', 'İstanbul', NULL, '/m/0kg2tb3');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(151, 'İstanbul Bilgi Üniversitesi', 'Hacıahmet Mahallesi, Pir Hüsamettin Sokak No:20, 34440 Beyoğlu İstanbul', NULL, 'http://www.bilgi.edu.tr/', 'Bilgi Üniversitesi 7 Haziran 1996 tarihinde Bilgi Eğitim ve Kültür Vakfı tarafından bilimin ve sanatın sınırlarını genişleten, özgürlükçü, toplumsal gelişime önderlik eden, öğrencileri ile akademik kadrosunun birlikte öğrenme tutkusu etrafında buluştukları, bütün akademik ve idari bileşenlerinin bu arayışa kendilerini adadıkları uluslararası bir üniversite olma amacıyla İstanbul\'da vakıf üniversitesi statüsünde kurulmuştur. Üniversite\'nin Kuştepe, Dolapdere ve Santralistanbul olmak üzere üç yerleşkesi bulunmaktadır. 25.000 öğrencinin öğrenim gördüğü üniversitenin 6 fakülte, 5 enstitü, 5 yüksekokul ve 3 meslek yüksekokulunda 1.000 akademik personel görev almaktadır.', 'istanbul-bilgi-universitesi', NULL, NULL, 'İstanbul', NULL, '/m/0815rx');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(152, 'İstanbul Bilim Üniversitesi', 'Gayrettepe, 34349 İstanbul, Türkiye', NULL, 'http://www.istanbulbilim.edu.tr', '', 'istanbul-bilim-universitesi', NULL, NULL, 'İstanbul', NULL, NULL);
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(153, 'İstanbul Esenyurt Üniversitesi', 'Doğan Araslı Bulv. No:79 Esenyurt, İstanbul / Türkiye', NULL, 'http://www.esenyurt.edu.tr', 'İstanbul Esenyurt Üniversitesi, Yeşilköy 2001 Eğitim, Sağlık, Kültür Vakfı tarafından Özgürlükçü, akademik ve fiziki altyapısı ile öne çıkan, geleneklere ve farklılığa saygılı,Ülkesine ve bilime hizmeti amaç edinmiş, disiplinler arası ve dünya standartlarında bir eğitim anlayışı ile özgün bilgiler yaratılmasını sağlayan, geleceğe yön verebilecek bireyleri yetiştiren öncü bir dünya üniversitesi olma amacıyla İstanbul\'da vakıf üniversitesi statüsüyle kurulmuştur.180 akademik personelin çalışma yürüttüğü Üniversite bünyesinde 4 fakülte, 2 yüksekokulu, 2 meslek yüksekokulu 3 enstitü ve bu birimlerde de okuyan 3667 öğrenci bulunmaktadır.', 'istanbul-esenyurt-universitesi', NULL, NULL, 'İstanbul', NULL, '/g/1s067rlyt');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(154, 'İstanbul Gelişim Üniversitesi', 'Cihangir mah. Şehit Jandarma Komando Er Hakan Öner Sk. No:1 Avcılar / İSTANBUL', NULL, 'http://www.gelisim.edu.tr', 'İstanbul Gelişim Üniversitesi, Gelişim Eğitim ve Kültür Vakfı tarafından 14.7.2008 tarihinde yüksekokul olarak kurulmuştur. 17.02.2011 tarihine gelindiğinde ise vakıf üniversitesi statüsünde eğitime başlamıştır. Üniversite Avcılar\'da bulunan Cihangir Mahallesi\'ndeki yerleşkesini merkez yerleşke olarak belirlemiştir. Üniversitenin Avcılar yan yol üzerinde bir meslek yüksekokulu yerleşkesi de bulunmaktadır. Üniversite, 3 fakültesi, 3 yüksekokulu, 2 meslek yüksekokulu ve 3 enstitüsünde yaklaşık 170 bölümle, 20 bin öğrenciye 394 akademik personeli ile eğitim vermektedir.', 'istanbul-gelisim-universitesi', NULL, NULL, 'İstanbul', NULL, '/g/1hb_dh4lr');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(155, 'İstanbul Kemerburgaz Üniversitesi', 'Mahmutbey Dilmenler Caddesi,   No:26, 34217 Bağcılar - İSTANBUL', NULL, 'http://www.kemerburgaz.edu.tr', 'İstanbul Kemerburgaz Üniversitesi 2008 yılında, Mehmet Altınbaş Eğitim ve Kültür Vakfı tarafından kurulmuş İstanbul\'da bilim farkıyla önde sloganıyla vakıf üniversitesi olarak kurulmuştur. Üniversite ilk öğrencilerini 2011-2012 akademik yılında alarak eğitim-öğretim hayatına başlamıştır. Üniversitenin Şişli ve Mahmutbey olmak üzere 2 yerleşkesi bulunmaktadır. 3861 öğrencinin öğrenim gördüğü üniversitenin 8 fakülte, 3 enstitü ve 2 meslek yüksekokulunda 310 akademik personel görev yapmaktadır.', 'istanbul-kemerburgaz-universitesi', NULL, NULL, 'İstanbul', NULL, '/m/0pdny5h');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(156, 'İstanbul Kültür Üniversitesi', 'E5 Karayolu üzeri Bakırköy 34156 İstanbul', NULL, 'http://www.iku.edu.tr', 'İstanbul Kültür Üniversitesi 15 Temmuz 1997 tarihinde Türkiye Cumhuriyeti Devleti’nin ve Türk milletinin "çağdaş medeniyet seviyesini aşma" yolunda değişmez hedefine ulaşması, gençlerin, hangi aşamada olursa olsun, nitelikli bir eğitim almaları ile ancak mümkün olduğundan hareketle kaliteli yükseköğretim yapma amacı ile İstanbul\'da vakıf üniversitesi statüsünde kurulmuştur. Kültür Üniversitesi\'nin Ataköy, Şirinevler ve İncirli olmak üzere 3 yerleşkesi bulunmaktadır. 10743 öğrencinin öğrenim gördüğü üniversitede bulunan 7 fakülte, 3 meslek yüksekokulu, 2 enstitü ve 10 araştırma merkezinde 611 akademik personel görev yapmaktadır.', 'istanbul-kultur-universitesi', NULL, NULL, 'İstanbul', NULL, '/m/0ch4_4d');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(157, 'İstanbul Medipol Üniversitesi', 'Unkapanı, Atatürk Bulvarı No:27 34083 Fatih-İstanbul', NULL, 'http://www.medipol.edu.tr/', 'İstanbul Medipol Üniversitesi, Türkiye Eğitim Sağlık ve Araştırma Vakfı tarafından 7 Temmuz 2009 tarihinde İstanbul\'da güçlü kurumsal kültürü, girişimcilik ruhu ve sürekli gelişime açık dinamizmi ile bilime ve topluma yön veren öncü bir üniversite olma vizyonuyla vakıf üniversitesi olarak kurulmuştur. Üniversite rektörlüğün bulunduğu Haliç Yerleşkesi ve diğer yerleşkesi olan Kavacık Yerleşkesi\'nde konumlanmıştır. 4942 öğrencinin öğrenim gördüğü üniversitenin 11 Fakülte, 1 yüksekokul, 4 meslek yüksekokulu, 4 enstitü ve 7 araştırma ve uygulama merkezinde 683 akademik personel görev almaktadır.', 'istanbul-medipol-universitesi', NULL, NULL, 'İstanbul', NULL, '/g/1hb_fvc0h');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(158, 'İstanbul Rumeli Üniversitesi', 'Yeni Mah. Mehmet Silivri Cad. No: 38 Silivri - İstanbul / TÜRKİYE', NULL, 'http://www.rumeli.edu.tr/', 'İstanbul Rumeli Üniversitesi, 3 Fakülte, 4 Meslek Yüksekokulu, 2 Enstitü ile İstanbul\'da, Silivri, Çatalca, Esenyurt ve Maltepe yerleşkelerinde faaliyet göstermektedir. 2016-2017 eğitim öğretim yılında ilk öğrencilerini karşılayacak olan üniversite, çağdaş eğitim programları ve mezunlarının kalitesiyle fark yaratacak öncü üniversite olmayı vizyon edinmiştir. Ayrıca, yaşam boyu eğitim felsefesiyle insan gücü kalitesinin yükseltilmesine katkı sağlamak üniversite değerlerindendir.', 'istanbul-rumeli-universitesi', NULL, NULL, 'İstanbul', NULL, NULL);
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(159, 'İstanbul Sabahattin Zaim Üniversitesi', 'İstanbul Sabahattin Zaim Üniversitesi, Halkalı Cad. No:2 Halkalı - Küçükçekmece / İSTANBUL', NULL, 'http://www.izu.edu.tr', 'İstanbul Sabahattin Zaim Üniversitesi , 2010 yılında İstanbul\'da İlim Yayma Vakfı tarafından akademik ve fiziki alt yapısı ile öne çıkan, mezunları tercih edilen, yayınları başvuru kaynağı olan ve üniversitelerimiz arasında ilk yedide yer alan bir araştırma üniversitesi olma amacıyla kurulan bir vakıf üniversitesidir. Merkez kampüsü Halkalı\'da bulunan İzü\'nün Eyüp\'te de yerleşkesi bulunmaktadır. 2517 öğrencinin öğrenim gördüğü üniversitenin 8 fakülte ve 2 enstitüsünde 163 akademisyen görev almaktadır.', 'istanbul-sabahattin-zaim-universitesi', '28.7883359', '41.0336113', 'İstanbul', NULL, '/m/0zdnj1v');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(160, 'İstanbul Şehir Üniversitesi', 'Kuşbakışı Caddesi No: 27 34662, Altunizade – Üsküdar – İstanbul', NULL, 'http://www.sehir.edu.tr', 'İstanbul Şehir Üniversitesi, 1986 yılından bu yana Bilim ve Sanat Vakfı’na yön veren akademik arayışın içinden doğdu. Gerçek bir “vakıf üniversitesi” olarak yola çıkan İstanbul Şehir Üniversitesi, fiilî kuruluş çalışmalarına 2007 yılında başladı.Keşifsel bilginin üretimine ve yaygınlaştırılmasına katkıda bulunmayı amaçlayan İstanbul Şehir Üniversitesi, özgün, katılımcı, evrensel ve özgürlükçü perspektifiyle ve zenginleşen ekibiyle, 2010-2011 akademik yılında ilk öğrencileri ile buluştu. İstanbul Şehir Üniversitesi, Halen 6 fakülte, 3 enstitü çatısı altında 14 lisans, 15 lisansüstü programı ile Altunizade Doğu, Altunizade Batı ve Altunizade Güney Kampüsleri\'nde 188 akademik personeli ve 3393 öğrencisiyle faaliyetlerini sürdürüyor.İstanbul Şehir Üniversitesi misyonu; iyi, doğru ve güzeli aramak, insan, toplum ve doğayı anlamak, bu arayışın ürünü olan bilgileri tüm insanlıkla paylaşmaktır.', 'istanbul-sehir-universitesi', NULL, NULL, 'İstanbul', NULL, '/m/0dllgdd');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(161, 'İstanbul Ticaret Üniversitesi', 'Küçükyalı E5 Kavşağı İnönü Cad. No: 4, Küçükyalı 34840, İstanbul', NULL, 'http://www.ticaret.edu.tr', 'İstanbul Ticaret Üniversitesi, İstanbul Ticaret Odası Eğitim ve Sosyal Hizmetler Vakfı tarafından 2001 yılında akademik esnekliğini yitirmeden, bilgi çağının gerekliliği olan disiplinler arası çalışmaları bünyesinde yürütebilen; uluslararası bilimsel faaliyetlerde aktif ve belirleyici olarak yer alan, adını aldığı İstanbul’a yaraşır, yalnız ulusal düzeyde değil uluslararası düzeyde de saygınlığı kabul edilmiş, önde gelen akademik kurumların içinde yer alma vizyonuyla İstanbul\'da kurulmuştur. Üniversite\'nin yerleşkeleri Eminönü, Sütlüce, Küçükyalı ve Bursa\'da konumlanmıştır. 7.000 öğrencinin öğrenim gördüğü 6 fakülte (Fen Edebiyat, Ticari Bilimler, Hukuk, İletişim, Mühendislik ve Tasarım ile Uygulamalı Bilimler), İngilizce Hazırlık Bölümü ve 4 enstitü (Dış Ticaret, Sosyal Bilimler, Fen Bilimleri ve Finans Enstitüsü) ile araştırma ve uygulama merkezlerinde 300’ü aşkın akademisyen görev almaktadır.', 'istanbul-ticaret-universitesi', NULL, NULL, 'İstanbul', NULL, '/m/05b4f29');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(162, 'İstinye Üniversitesi', 'Maltepe Mahallesi Edirne Çırpıcı Yolu No.9 Cevizlibağ / Topkapı / İstanbul / TÜRKİYE', NULL, 'http://www.istinye.edu.tr/', 'İstinye Üniversitesi, Türkiye’nin en büyük sağlık markası olan MLPCare Grubu’nun eğitime değerli bir yatırımıdır. Türkiye\'nin dört bir yanında 27 hastane ve 14 bin çalışanıyla hizmet veren bir sağlık grubu olarak 20 yılı aşkın sürede kazandığı bilgi ve birikimi, siz gençlerimizin eğitim ve öğretimi için kullanacaktır. İstinye Üniversitesi, bu yıl Tıp Fakültesi, Sağlık Bilimleri Fakültesi ve Sağlık Hizmetleri Meslek Yüksekokulu’yla eğitime başlayacak olup tüm öğrencilerine belli oranlarda burs verecektir. Ayrıca bütün öğrencilerini sağlık sigortasıyla güvenceye alacaktır.', 'istinye-universitesi', NULL, NULL, 'İstanbul', NULL, NULL);
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(163, 'İzmir Ekonomi Üniversitesi', 'İzmir Ekonomi Üniversitesi, Sakarya Caddesi, No:156, 35330 Balçova - İzmir / TÜRKİYE', NULL, 'http://www.ieu.edu.tr', 'İzmir Ekonomi Üniversitesi 14 Nisan 2001 tarihinde, evrensel düzeyde kaliteli eğitim-öğretim ve bilimsel araştırmalarla topluma öncülük eden seçkin bir yüksek öğretim kurumu amacıyla İzmir’de bölgenin ilk vakıf üniversitesi olarak kurulmuştur. Üniversite\'nin tek kampüsü Balçova Kampüsü\'dür. Üniversite bünyesinde bulunan 8 fakülte, 2 yüksekokul, 3 meslek yüksekokulu, 3 enstitü, 9 uygulama ve araştırma merkezinde 7605 öğrenci öğrenim görmektedir.', 'izmir-ekonomi-universitesi', '27.044704', '38.3877014', 'İzmir', NULL, '/m/08w6yd');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(164, 'Kadir Has Üniversitesi', 'Kadir Has Caddesi, Cibali / İSTANBUL 34083', NULL, 'http://www.khas.edu.tr', 'Kadir Has Vakfı (HASVAK) tarafından 28.05.1997 tarihinde İstanbul\'da Dünya\'nın ileri gelen üniversitelerine koşut bir eğitim, araştırma ve tartışma ortamı sağlama ve öğrencilerinin disiplinler arası donanım ile yetiştirilmeleri, geleceğe hazırlanırken sosyal ve kültürel alanlarda gelişimlerini sürekli kılmaları, doğruyu ararken çok yönlü değerlendirme yapmayı öğrenmeleri amacıyla vakıf üniversitesi statüsünde kurulmuştur. Üniversite merkez kampüsü olan Kadir Has Kampüsü (Cibali) dışında Bahçelievler ve Selimpaşa Kampüsleri\'nde konumlanmıştır. 6130 öğrencinin öğrenim gördüğü üniversite bünyesinde bulunan 6 fakülte, 9 araştırma merkezi, 3 enstitü, 2 meslek yüksekokulu, 1 yüksekokul ve 1 yaşam boyu eğitim merkezinde 246 akademik personel çalışmalarını yürütmektedir.', 'kadir-has-universitesi', '28.958712', '41.025105', 'İstanbul', NULL, '/m/026kpcz');
INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
