	(175, 'Nuh Naci Yazgan Üniversitesi', 'Kuzey Çevreyolu Erkilet Dere Mah. Nuh Naci Yazgan Üniversitesi Yerleşkesi Kocasinan/KAYSERİ', NULL, 'http://www.nny.edu.tr', 'Nuh Naci Yazgan Üniversitesi Kayseri Yükseköğrenim ve Yardım Vakfı tarafından 23.06.2009 tarihinde Dünya standartlarında eğitim-öğretim ve bilimsel araştırma faaliyetleri yürüten; bilgi toplumunun oluşumuna katkı sağlayan; ülkemizin bilim, teknoloji, ve sanat alanında çağdaş uygarlık seviyesinin üzerine çıkmasına öncülük eden; akademik temeli sağlam olan; üniversite-sanayi iş birliğini en etkin bir şekilde gerçekleştiren; ulusal ve uluslararası düzeyde saygın ve lider bir üniversite olma vizyonu ile Kayseri\'de kurulan bir vakıf üniversitesidir. Üniversite Kocasinan\'da bulunan Nuh Naci Yazgan Üniversitesi Yerleşkesi\'nde konumlanmıştır. 1362 öğrencinin öğrenim gördüğü üniversitenin 6 fakülte, 2 enstitü ve 1 meslek yüksekokulunda 54 akademik personel akademik çalışma yürütmektedir.', 'nuh-naci-yazgan-universitesi', NULL, NULL, 'Kayseri', NULL, '/g/1234brnq');
