	(178, 'Özyeğin Üniversitesi', 'Özyeğin Üniversitesi Çekmeköy Kampüsü, Nişantepe Mah. Orman Sok. 34794 Çekmeköy - İSTANBUL', NULL, 'http://www.ozyegin.edu.tr/Anasayfa', 'Özyeğin Üniversitesi Hüsnü M. Özyeğin Vakfı tarafından 2005 18 Mayıs 2007 tarihinde vakıf üniversitesi statüsü ile İstanbul\'da kurulmuştur. Maddi yönden erişilebilir ve girişimci bir araştırma üniversitesi olduğunu beyan eden Özyeğin Üniversitesi, bütün programlarında Türkiye, Doğu Avrupa ve Orta Doğu’nun en iyi on üniversitesinden biri ve dünyanın en iyi ilk iki yüz üniversitesinden biri olarak hem ulusal hem de uluslararası arenada kabul görmeyi hedeflemektedir. Çekmeköy Kampüsü\'nde faaliyetlerini yürüten 5395 öğrencinin öğrenim gördüğü üniversitenin bünyesinde 5 fakülte, 3 enstitü, 3 yüksekokul bulunmaktadır. Bu birimlerde 305 akademik personel görev almaktadır.', 'ozyegin-universitesi', '28.8988719', '41.0089039', 'İstanbul', NULL, '/m/03m62zw');
