INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(180, 'Sabancı Üniversitesi', 'Sabancı Üniversitesi, Orta Mahalle, Üniversite Caddesi No:27 Tuzla, 34956 İstanbul', NULL, 'http://www.sabanciuniv.edu', '1999 yılında katılımcı farklılığa saygılı, özgürlükçü bir kurum kültürü içinde, tüm paydaşlarımızın gereksinimlerine duyarlı, yenilikçi, disiplinler arası bir eğitim altyapısı ile, öncülüğe yol açan özgün bilginin yaratılmasını ve yayılmasını sağlayan, araştırma ve eğitim alanındaki yaratıcılığı ile uluslararası bir referans noktası olma vizyonuyla İstanbul’da eğitime başlayan Sabancı Üniversitesi, Mühendislik ve Doğa Bilimleri, Sanat ve Sosyal Bilimler ve Yönetim Bilimleri Fakülteleri altında 13 lisans ve 54 lisansüstü programıyla eğitim veren Türkiye\'nin ilk bölümsüz vakıf üniversitesidir. Tuzla Kampüsü\'nün merkez yerleşke olduğu üniversitede 4097 öğrenci öğrenim görmekte 388 akademik personel de görev almaktadır. Sabancı Üniversitesi Times Higher Education\'ın "Dünya 50 Yaşın Altındaki En İyi 100 Üniversite-2015" listesinde Türkiye\'de 1., dünyada 13. olmuştur. Bilim Sanayi ve Teknoloji Bakanlığı\'nın açıkladığı "Girişimci ve Yenilikçi Üniversite Endeksi 2015" sıralamasında da 1. seçilmiştir. İstanbul Politikalar Merkezi, Sakıp Sabancı Müzesi ve Nanoteknoloji Araştırma ve Uygulama Merkezi (SUNUM) Sabancı Üniversitesi bünyesinde bulunmaktadır. ***Sabancı Üniversitesi\'nde bölüm yapılanması olmadığı için programlar fakülte adı altında verilmiştir.', 'sabanc-universitesi', NULL, NULL, 'İstanbul', NULL, '/m/03400z');
