INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(183, 'Ted Üniversitesi', 'TED Üniversitesi, Ziya Gökalp Caddesi No.48, 06420, Kolej Çankaya, ANKARA', NULL, 'http://www.tedu.edu.tr', 'TED Üniversitesi 7.07.2009 tarihinde Türk Eğitim Derneği Yükseköğrenim Vakfı tarafından Ankara\'da küresel bilgi ekonomisinin gerektirdiği genişlik-derinlik dengesine sahip diploma programları ve yenilikçi öğretim yöntemleri ile çok yönlü, eleştirel düşünebilen, yaratıcı, girişimci, özgüveni yüksek ve hayat boyu öğrenmeyi ilke edinmiş bireylerin yetişmesini sağlamak; kurumsal öncelikli alanlarda araştırma ve yaratıcı çabalarla bilime evrensel katkı yapmak, şeffaf ve kurumsal yapısı ile tüm paydaşlarına hesap ve güven vermeyi ilke edinmiş, sürekliliği ve sürdürülebilir gelişmeyi hedefleyen, öğrenmeye açık bir üniversite olmayı misyon edinerek kurulmuş bir vakıf üniversitesidir. 1002 öğrencinin öğrenim gördüğü Çankaya ilçesindeki yerleşkesinde faaliyet gösteren üniversitenin 4 fakülte, 3 yüksek lisans programı ve temel bilimler biriminde 109 akademik personel akademik faaliyetlerini sürdürmeye devam etmektedir.', 'ted-universitesi', NULL, NULL, 'Ankara', NULL, '/g/1224zqh1');
