INSERT INTO `university` (`id`, `name`, `address`, `logo`, `website`, `desc`, `url`, `longitude`, `latitude`, `city`, `type`, `social`) VALUES
	(192, 'Üsküdar Üniversitesi', 'Altunizade Mh. Haluk Türksoy Sk. No:14 PK:34662 Üsküdar / İstanbul / Türkiye', NULL, 'http://www.uskudar.edu.tr', 'Üsküdar Üniversitesi, İnsani Değerler ve Ruh Sağlığı Vakfı tarafından 3 Mart 2011 tarihinde Çağdaş insan ve insan odaklı teknolojiye hâkim, yüksek nitelikli eğitim, öğretim, araştırma ve uygulama programları geliştirmek. Bölgesel kalkınmaya katma değer ve katılım sağlayan öncü, örnek bir evrensel üniversite olma ve Türkiye\'de, Avrupa Birliği ve dünya standartlarında eğitim ve öğretim yapma vizyonuyla İstanbul\'da kurulmuş bir vakıf üniversitesidir. Merkez, Güney ve Çarşı Yerleşkeleri\'nde öğretim yapan 6.275 öğrencinin öğrenim gördüğü üniversite bünyesinde 4 fakülte, 1 yüksekokul, 4 enstitü faaliyette bulunmaktadır. Bu birimlerde 239 akademik personel görev almaktadır.', 'uskudar-universitesi', NULL, NULL, 'İstanbul', NULL, '/g/15dqchld');
