	(194, 'Yaşar Üniversitesi', 'Üniversite Caddesi, No:37-39, Ağaçlı Yol, Bornova, İzmir PK. 35100', NULL, 'http://www.yasar.edu.tr', 'Yaşar Üniversitesi Yaşar Eğitim ve Kültür Vakfı tarafından 2001 yılında teknoloji ve bilimi entegre eden, fen ağırlıklı, dünyaya açılmış bir üniversite olma vizyonuyla vakıf üniversitesi statüsüyle İzmir’de kuruldu. Üniversite Bornova’da bulunan Selçuk Yaşar Kampüsü ve kampüsün yanına inşa edilen 8 bin 400 metrekarelik ek kampüs alanında eğitim öğretim faaliyetlerini sürdürmektedir. Eğitim dilinin İngilizce olduğu üniversite bünyesinde 7525 öğrencinin öğrenim gördüğü 7 fakülte, 25 bölüm, 1 meslek yüksekokulu ve adalet meslek yüksekokulu, fen bilimleri enstitüsü ve sosyal bilimler enstitüleri bulunmaktadır. Bu birimlerde 407 akademik personel akademik çalışmalarını sürdürmektedir.', 'yasar-universitesi', '27.202611', '38.454113', 'İzmir', NULL, '/m/0cpdqnn');
